INSERT INTO `feedbacks_feedbackform` VALUES (1,'{0: 1, 1: 2, 2: 3, 3: 1, 4: 3, 5: 2, 6: 2, 7: 2, 8: 1, 9: 2, 10: 3, 11: 2, 12: 2, 13: 2, 14: 2, 15: 2, 16: 3, 17: 3, 18: 3, 19: 3, 20: 3, 21: 3, 22: 3, 23: 3, 24: 3, 25: 2, 26: 2, 27: 5, 28: \'hgujj\', 29: \'bhhnj\'}','2019-11-11 08:52:21.379775',1),(2,'{0: 1, 1: 2, 2: 2, 3: 2, 4: 2, 5: 2, 6: 2, 7: 2, 8: 3, 9: 2, 10: 2, 11: 2, 12: 2, 13: 2, 14: 2, 15: 3, 16: 2, 17: 2, 18: 3, 19: 3, 20: 3, 21: 3, 22: 3, 23: 3, 24: 3, 25: 2, 26: 1, 27: 1, 28: \'dfdh\', 29: \'fdf\'}','2019-11-11 08:54:50.657444',2),(3,'{0: 1, 1: 1, 2: 1, 3: 1, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 1, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 1, 19: 1, 20: 1, 21: 1, 22: 1, 23: 1, 24: 1, 25: 1, 26: 1, 27: 1, 28: \'dfr\', 29: \'fdsd\'}','2019-11-11 08:58:03.801846',3),(4,'{0: 1, 1: 1, 2: 1, 3: 1, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 1, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 1, 19: 1, 20: 1, 21: 1, 22: 1, 23: 1, 24: 1, 25: 1, 26: 1, 27: 1, 28: \'ddff\', 29: \'fgfv\'}','2019-11-11 08:58:49.231266',4),(5,'{0: 1, 1: 1, 2: 1, 3: 1, 4: 1, 5: 1, 6: 1, 7: 2, 8: 3, 9: 2, 10: 3, 11: 2, 12: 1, 13: 3, 14: 2, 15: 1, 16: 2, 17: 2, 18: 1, 19: 2, 20: 1, 21: 3, 22: 2, 23: 3, 24: 1, 25: 2, 26: 1, 27: 3, 28: \'kib\', 29: \'nkhb\'}','2019-11-11 08:59:37.849053',5),(6,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 8: 2, 9: 2, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 1, 24: 1, 25: 1, 26: 2, 27: 2, 28: \'Good\', 29: \'Goid\'}','2019-11-12 04:16:48.378844',8),(7,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 3, 5: 1, 6: 1, 7: 2, 8: 2, 9: 2, 10: 2, 11: 1, 12: 1, 13: 2, 14: 2, 15: 1, 16: 1, 17: 3, 18: 3, 19: 3, 20: 2, 21: 2, 22: 3, 23: 3, 24: 1, 25: 2, 26: 2, 27: 3, 28: \'Can do a better job at handling the assignments \', 29: \'everything about the prof is good enough\'}','2019-11-12 04:18:58.748493',8),(8,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 1, 5: 2, 6: 2, 7: 1, 8: 1, 9: 2, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 2, 24: 3, 25: 2, 26: 2, 27: 2, 28: \'Learn marketing. Use Google while doing assignment. Extra information required and appreciated. \', 29: \'Be more gentle towards criticism. Suggest things to Help build the product not only find the faults. We are amateurs and this is definitely a very new subject to us. Be patient with us :) \'}','2019-11-12 04:21:46.482319',8),(9,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 2, 5: 1, 6: 2, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 3, 19: 3, 20: 2, 21: 2, 22: 3, 23: 2, 24: 1, 25: 1, 26: 1, 27: 3, 28: \'Do only if you are interested in the Business Development. \', 29: \'Please start the pitch reviews earlier and give more constructive feedback for pitch during upgraded pitches.\'}','2019-11-12 04:24:07.817502',8),(10,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 2, 5: 2, 6: 2, 7: 1, 8: 1, 9: 2, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 2, 26: 2, 27: 2, 28: \'Take help of Google while doing assignments. It will help better the quality and more knowledge. \', 29: \'Good teacher \'}','2019-11-12 04:24:20.300809',9),(11,'{0: 2, 1: 2, 2: 1, 3: 1, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 1, 20: 2, 21: 2, 22: 2, 23: 1, 24: 1, 25: 1, 26: 2, 27: 1, 28: \'It helps you understand the way to value any product\', 29: \'A bit of coherence neededbetween the two professors\'}','2019-11-12 04:24:20.408127',8),(12,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 2, 11: 1, 12: 1, 13: 2, 14: 2, 15: 2, 16: 2, 17: 2, 18: 3, 19: 3, 20: 3, 21: 2, 22: 2, 23: 2, 24: 1, 25: 1, 26: 1, 27: 2, 28: \'Take this course only if you are interested in Bdev.\', 29: \'Please give more constructive feedback during ungraded pitches\'}','2019-11-12 04:30:32.269531',9),(13,'{0: 2, 1: 2, 2: 1, 3: 1, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 1, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 1, 20: 3, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1, 26: 1, 27: 1, 28: \'Take the course\', 29: \'He is fine\'}','2019-11-12 04:31:06.779556',9),(14,'{0: 3, 1: 2, 2: 2, 3: 1, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 1, 11: 1, 12: 2, 13: 3, 14: 2, 15: 3, 16: 2, 17: 3, 18: 2, 19: 1, 20: 2, 21: 2, 22: 3, 23: 3, 24: 1, 25: 2, 26: 2, 27: 3, 28: \'Both professors will give you different advice and then grill you later for the things you did accordingly. \', 29: \'Needs to be more responsive to what the students is asking. \'}','2019-11-12 04:31:17.810717',8),(15,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 1, 5: 1, 6: 2, 7: 1, 8: 2, 9: 1, 10: 1, 11: 1, 12: 1, 13: 3, 14: 3, 15: 2, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 3, 23: 3, 24: 1, 25: 2, 26: 1, 27: 2, 28: \'Its a good learning experience.\', 29: \'Good command over the course\'}','2019-11-12 04:35:24.294710',8),(16,'{0: 2, 1: 2, 2: 3, 3: 3, 4: 2, 5: 2, 6: 1, 7: 2, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 1, 21: 2, 22: 1, 23: 2, 24: 3, 25: 1, 26: 2, 27: 3, 28: \'Professor teaches advanced topics without teaching basics.\', 29: \'NA\'}','2019-11-12 04:35:24.357474',16),(17,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 2, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 3, 18: 2, 19: 2, 20: 1, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 3, 28: \'Does not spend enough time on basics \', 29: \'Should teach basics first\'}','2019-11-12 04:37:16.412131',17),(18,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 2, 5: 2, 6: 2, 7: 2, 8: 3, 9: 3, 10: 3, 11: 2, 12: 2, 13: 3, 14: 2, 15: 3, 16: 3, 17: 5, 18: 3, 19: 3, 20: 1, 21: 1, 22: 3, 23: 3, 24: 2, 25: 2, 26: 2, 27: 2, 28: \'Read books\', 29: \"Vinod sir didn\'t come for a single class. \"}','2019-11-12 04:39:26.991466',16),(19,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 3, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 2, 13: 2, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 3, 28: \'Do assignments on time\', 