 have been better.\", 29: \" I feel like the course progressed a little slow, could\'ve learned a few more topics in more detail. The instructor (Madhav sir) was always ready to stay back after class and help students out. Vinod sir is a very good teacher in that he is confident in what he says and is well audible. He is good at clearing doubts as well.\"}','2019-11-12 04:44:18.528536',12),(36,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 3, 25: 2, 26: 2, 27: 2, 28: \'Not an elective\', 29: \'Some more material to read for what is taught in class as biology was new to us at this point of time\'}','2019-11-12 04:44:22.585471',13),(37,'{0: 2, 1: 1, 2: 3, 3: 3, 4: 1, 5: 2, 6: 1, 7: 2, 8: 3, 9: 2, 10: 3, 11: 2, 12: 2, 13: 1, 14: 3, 15: 1, 16: 1, 17: 3, 18: 2, 19: 3, 20: 1, 21: 1, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 5, 28: \'Course is not an elective. Course is very disorganized, very poorly structured. you will not learn much from here, the instructor will mostly just directly copy derivations from the textbook\', 29: \'Please be more in touch with the subject. It is very hard as a student when the professor himself is not accustomed to the course. \'}','2019-11-12 04:44:30.223743',12),(38,'{0: 1, 1: 2, 2: 2, 3: 5, 4: 3, 5: 1, 6: 1, 7: 2, 8: 2, 9: 2, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 3, 18: 2, 19: 2, 20: 3, 21: 2, 22: 1, 23: 3, 24: 3, 25: 1, 26: 2, 27: 4, 28: \"Don\'t\", 29: \'His content and teaching style were good but his lack of confidence was a bit discouraging to anyone who was trying to listen.\'}','2019-11-12 04:44:38.052178',17),(39,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 2, 11: 1, 12: 1, 13: 2, 14: 2, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 3, 23: 3, 24: 3, 25: 1, 26: 2, 27: 3, 28: \'Not an elective course\', 29: \'Please provide a reference m\'}','2019-11-12 04:44:56.529305',13),(40,