stration after class.\"}','2019-11-12 10:07:05.203704',20),(335,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 1, 5: 1, 6: 1, 7: 2, 8: 1, 9: 1, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 1, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1, 26: 2, 27: 1, 28: \'Take this course only if you have a research problem at hand which you are actively working on. Otherwise this course will be a waste of your time, value of the course comes from applying it as you go.\', 29: \"I think sessions with other faculty was a great idea but it didn\'t turn out to be very good use of time. Maybe we can ask the faculty to actually teach a 30 min class. Their context was not very clear when they answered, if they could spend more time in class talking it would have helped. \\r\\nIt seemed like instructors were not very sure if they were doing justice to the course. While that humility is appreciated, I think that hurt the course somewhat. It would have been better if they had said: this is cognitive science and machine learning focused example.. theories are common and applicable but examples are from some specific domains. And proceed without sounding apologetic about it. Currently, the course seemed shallow because we didn\'t tackle hard problems of any domain. I am sure good hard problems of any domain are worth exploring and are lesson worthy for people in other domains as well. \\r\\n\"}','2019-11-12 10:08:34.062951',20),(336,'{0: 1, 1: 2, 2: 3, 3: 5, 4: 3, 5: 2, 6: 2, 7: 2, 8: 3, 9: 3, 10: 3, 11: 2, 12: 2, 13: 2, 14: 3, 15: 2, 16: 2, 17: 4, 18: 3, 19: 3, 20: 1, 21: 2, 22: 1, 23: 1, 24: 2, 25: 1, 26: 2, 27: 5, 28: \"Don\'t \", 29: \'Na\'}','2019-11-12 10:08:46.602294',24),(337,'{0: 2, 1: 1, 2: 2, 3: 3, 4: 2, 5: 2, 6: 2, 7: 2, 8: 2, 9: 2, 10: 2, 11: 2, 12: 2, 13: 2, 14: 2, 15: 2, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 3, 23: 2, 24: 1, 25: 2, 26: 2, 27: 3, 28: \'Think twice\', 29: \'I dont think im good enough to suggest\'}','2019-11-12 10:08:51.196408',24),(338,'{0: 1, 1: 1, 2: 