53.138683',37),(557,'{0: 2, 1: 2, 2: 2, 3: 4, 4: 3, 5: 2, 6: 2, 7: 1, 8: 3, 9: 3, 10: 1, 11: 1, 12: 1, 13: 3, 14: 1, 15: 1, 16: 1, 17: 3, 18: 3, 19: 2, 20: 2, 21: 3, 22: 2, 23: 2, 24: 3, 25: 2, 26: 2, 27: 4, 28: \"As an elective, if the student has some prior knowledge in coding then it would be a good course for him.\\r\\nBut for me, as I am a noob in coding, I felt this course way tough for me and couldn\'t understand a thing.\", 29: \'Vineet Gandhi sir was very good in his teaching skills.I could understand some or the other things.\\r\\nBut Paruchuri sir was way too fast for me and could not match with his pace or way of explaining.\'}','2019-11-13 07:31:03.249471',36),(558,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 17: 1, 18: 3, 19: 1, 20: 2, 21: 2, 22: 1, 23: 2, 24: 3, 25: 2, 26: 2, 27: 1, 28: \'For people new to coding, it might a feel a little fast paced, so keeping up with topics is really important otherwise it can be difficult. \', 29: \'The professor does discussion on the small details of the program which is very helpful in thoroughly understanding the concept \'}','2019-11-13 07:31:05.721516',36),(559,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 3, 5: 1, 6: 1, 7: 1, 8: 3, 9: 3, 10: 2, 11: 2, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 5, 18: 3, 19: 2, 20: 2, 21: 3, 22: 1, 23: 1, 24: 3, 25: 1, 26: 1, 27: 3, 28: \'The course is good but it would have been better if the teaching was better\', 29: \'The teacher should be familiar with the material and be able to quickly solve students doubts \'}','2019-11-13 07:31:09.693196',37),(560,'{0: 2, 1: 3, 2: 1, 3: 1, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 3, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 1, 28: \'Nothing\', 29: \'Very well explanation\'}','2019-11-13 07:31:51.103799',36),(561,'{0: 2, 1: 2, 2: 1, 3: 1, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: