 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 2, 25: 1, 26: 2, 27: 5, 28: \"Don\'t take it.\", 29: \"You\'re alright.\\r\\nJust be more clear when you\'re explaining the math.\"}','2019-11-14 07:04:12.790124',46),(617,'{0: 2, 1: 2, 2: 3, 3: 5, 4: 2, 5: 2, 6: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 14: 1, 17: 5, 19: 2, 20: 1, 26: 1, 28: \'NLP is vast. If you seek for data science you must take this\', 29: \'Try to Engage students\'}','2019-11-14 07:04:20.094352',45),(618,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 2, 8: 2, 9: 2, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 3, 22: 2, 23: 2, 24: 1, 25: 1, 26: 1, 27: 2, 28: \"It\'s not exactly an introductory course.\", 29: \'Instructors should keep in mind that some non Computational Linguistics students also take the course. Instructor usually assumed that a lot of us are.\'}','2019-11-14 07:04:21.253283',45),(619,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 3, 24: 1, 25: 1, 26: 2, 27: 2, 28: \'Good course ,but marking standard can be improved.faculty should be involved a bit in marking as well.it is totally dependent on ta\\r\\n\', 29: \'Topic covered were very relevant\'}','2019-11-14 07:04:51.058740',45),(620,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 2, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 3, 17: 2, 18: 2, 19: 3, 20: 2, 21: 2, 22: 2, 23: 2, 24: 1, 25: 1, 26: 2, 27: 3, 28: \'A part of the course requires prior knowledge of language components so it would be better if you are aware of all terms used in linguistics parlance.\', 29: \'Effective: Discussions and taking examples.\\r\\nConstructive suggestions: More prior knowledge must be given on specific terms used in class as the course does not list any prerequisites.\'}','2019-11-14 07:04:56.367082',45),(621,'{0: 2, 1: 2, 2: 1, 3: 1, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1, 26: 2, 27: 1, 28: \'Understand the problem properly before attempting\', 29: \'Satisfactory\'}','2019-11-14 07:05:00.958771',46),(622,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1, 26: 1, 27: 2, 28: \'More of your lectures would have helped \', 29: \'Same as above\'}','2019-11-14 07:05:48.559396',46),(623,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 3, 18: 2, 19: 1, 20: 2, 21: 2, 22: 1, 23: 2, 24: 1, 25: 1, 26: 1, 27: 2, 28: \'Can take the course if you want to learn and know the introduction of NLP. \', 29: \'Explain algorithms like viterbi more clearly. It would be good if numerical examples would also be solved in the class\'}','2019-11-14 07:06:09.637850',45),(624,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1, 26: 2, 27: 3, 28: \'Opt for this only when yoynhave interest in linguistics.\', 29: \'Manish Sir taught us less,which we expected more.\'}','2019-11-14 07:06:13.840724',46),(625,'{0: 2, 1: 2, 4: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 14: 1, 17: 2, 18: 2, 19: 2, 20: 2, 26: 1, 28: \'Must for data science\', 29: \'None\'}','2019-11-14 07:06:17.168526',46),(626,'{0: 2, 1: 2, 2: 2, 3: 5, 4: 3, 5: 1, 6: 2, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 1, 24: 1, 25: 1, 26: 2, 27: 3, 28: \'If you are really interested in learning about the language representations and phenomenon or you are from LTRC, then only take this course. It is low on algorithmic study and mostly the language component is focussed on. Plus there was no balance between the topics taken by both the faculties.\', 29: \'A proper division of course material to be taught by both faculties is encouraged. Also, the instructor should try to give intuition behind things and phenomenon. Since, a lot of docus was on language, proper background study material and reference should have been suggested. The only book suggested, did not help us much.\'}','2019-11-14 07:06:28.733556',45),(627,'{0: 2, 1: 2, 2: 3, 3: 5, 4: 2, 5: 2, 6: 2, 7: 2, 8: 3, 9: 2, 10: 1, 11: 1, 12: 2, 13: 2, 14: 1, 15: 2, 16: 2, 17: 3, 18: 3, 19: 1, 20: 2, 21: 3, 22: 1, 23: 2, 24: 2, 25: 1, 26: 1, 27: 3, 28: \'Nothing\', 29: \'Nothing\\r\\n\'}','2019-11-14 07:06:34.010611',45),(628,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 1, 25: 1, 26: 2, 27: 2, 28: \'Take it if you have interest in linguistics\', 29: \'There should be more focus on implementation and NLP than linguistics\'}','2019-11-14 07:06:37.525691',46),(629,'{0: 2, 1: 1, 2: 2, 3: 4, 4: 2, 5: 1, 6: 2, 7: 2, 8: 2, 9: 2, 10: 3, 11: 1, 12: 1, 13: 3, 14: 1, 15: 1, 16: 1, 17: 4, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 1, 24: 2, 25: 1, 26: 1, 27: 4, 28: \'You might find more value in CL courses like CL1, CL2. \', 29: \'Prof Sanghal was repetitive, and that gobbled up a lot of time. Could have been more efficient and that would have freed up time for covering more crucial, relevant material. Ex: in the begining of course 2 lectures were spent on talking about language expression and semantics, the same was again talked about towards the end of course, in Formal semantics. Too much redundancy. \\r\\n\\r\\nProf Sanghal demonstrates his clear bias against statistical and other methods, and rubs that on students repetitively. \'}','2019-11-14 07:07:00.404299',45),(630,'{0: 2, 1: 2, 2: 3, 3: 5, 4: 2, 5: 1, 6: 1, 7: 2, 8: 2, 9: 2, 10: 1, 11: 2, 12: 1, 13: 1, 14: 1, 15: 1, 16: 3, 17: 5, 18: 2, 19: 2, 20: 1, 21: 3, 22: 2, 23: 2, 24: 1, 25: 1, 26: 1, 27: 5, 28: \"Please don\'t expect much from this course. Boring for non linguistics people\", 29: \'Classes and topics could have been more interesting\'}','2019-11-14 07:07:11.080658',46),(631,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 2, 5: 1, 6: 1, 7: 2, 8: 2, 9: 2, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 3, 22: 2, 23: 2, 24: 2, 25: 1, 26: 1, 27: 2, 28: \"Scope is the overview.. so the newer techniques like Bert won\'t be covered.focus on both linguistics part and ml part. So basic things from ml would be taken\", 29: \"Both Rajeev sir and Manish sir are extremely approachable and spend enough time in explaining things. You can anytime approach them with doubts and they will make sure that you understand it properly. Manish sir does ignore few things an doesn\'t cover them properly but the slides are good. \"}','2019-11-14 07:07:55.853900',45),(632,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 1, 25: 1, 26: 2, 27: 1, 28: \'Good\', 29: \'Not much\'}','2019-11-14 07:08:09.934679',45),(633,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1, 26: 2, 27: 1, 28: \'Student should be open to understand basics of NLP. Instead of jumping into how to use ML concepts in NLP\', 29: \'Instructor helped us in understanding basic Rule based approaches which is more important aspect of NLP.\'}','2019-11-14 07:08:12.005350',45),(634,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 1, 18: 2, 19: 1, 20: 2, 21: 2, 22: 2, 23: 3, 24: 1, 25: 1, 26: 2, 27: 1, 28: \'Good course. Be attentive throughout the class\', 29: \'Very communicative\\r\\nGood command on subject\'}','2019-11-14 07:08:55.633042',45),(635,'{0: 2, 1: 2, 2: 2, 3: 1, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 1, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 1, 25: 2, 26: 2, 27: 1, 28: \'Good Course\', 29: \'Good\'}','2019-11-14 07:09:28.504014',46),(636,'{0: 2, 1: 2, 2: 2, 3: 4, 4: 3, 5: 1, 6: 2, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 1, 24: 2, 25: 1, 26: 1, 27: 3, 28: \'Prof Shrivastavas part is very good. \', 29: \'Take more times for topics covered. Prof Manishs time was too less. \'}','2019-11-14 07:09:40.773673',46),(637,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 3, 20: 2, 21: 3, 22: 2, 23: 1, 24: 1, 25: 1, 26: 2, 27: 2, 28: \'Get some idea on Linguistics before taking the course.Takes lot of extra classes. Good course if you are actually interested in languages, understanding indian languages otherwise do not take the course. \', 29: \'Need to give more understanding on linguistics concepts in start of course for students who are not from linguistics.Assignments are sometimes given on topics that were not taught in class. I understand that sir wanted us to read textbook and do the assignment but he should atleast mention the topic and say that assignment would be coming and need to read text book. There were lot of extra classes taken.. So you need to decide on the scope of subject properly.\'}','2019-11-14 07:10:05.268616',45),(638,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 2, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 1, 25: 1, 26: 1, 27: 3, 28: \'Any overview of the topics are given pertaining to ML. Requires some knowledge of concepts in Linguistics.\', 29: \'Effective: Discussions and Explanation of certain concepts/algorithms.\\r\\nConstructive suggestions: The presentations can be improved to better explain the mathematical aspects of algorithms.\'}','2019-11-14 07:10:30.098132',46),(639,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 3, 24: 1, 25: 1, 26: 2, 27: 2, 28: \'Be attentive in class \', 29: \'Good command on subject\'}','2019-11-14 07:11:21.767085',46),(640,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 2, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 3, 22: 2, 23: 2, 24: 2, 25: 1, 26: 1, 27: 2, 28: \"The ml part is very basic but in line with the scope of the course. Advanced topics like Bert won\'t be covered.\", 29: \'Manish sir is approachable and ready to help anytime you need. He does tend to get little carried away and does not cover few topics in details but overall it was a good course \'}','2019-11-14 07:11:22.299514',46),(641,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 1, 5: 2, 6: 1, 7: 2, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 1, 20: 2, 21: 2, 22: 1, 23: 1, 24: 2, 25: 1, 26: 1, 27: 2, 28: \'..\', 29: \'The project should be allocated more time \'}','2019-11-14 07:11:38.264597',45),(642,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 3, 22: 2, 23: 2, 24: 1, 25: 1, 26: 2, 27: 2, 28: \'Course is more Rule based and for understanding Indian languages. Statistical models were very few in the scope. But they were taught well. \', 29: \'Very interactive and derivational class. But sometimes you jump to some other topic which makes us confused and loose interest. \'}','2019-11-14 07:13:57.926292',46),(643,'{0: 2, 1: 2, 2: 3, 3: 4, 4: 3, 5: 1, 6: 1, 7: 1, 8: 3, 9: 3, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 24: 3, 25: 1, 26: 2, 27: 3, 28: \'Good\', 29: \'Good\'}','2019-11-14 07:14:37.995571',47),(644,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 1, 9: 1, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 3, 24: 1, 25: 1, 26: 2, 27: 1, 28: \'Faculty is very knowledgeable.\', 29: \'All the topic touched were extremely important\'}','2019-11-14 07:14:40.592778',45),(645,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 1, 24: 3, 25: 1, 26: 1, 27: 2, 28: \'Good\', 29: \'Good\'}','2019-11-14 07:15:38.795100',47),(646,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'-\', 29: \'-\'}','2019-11-14 07:16:33.474992',43),(647,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 1, 22: 1, 23: 1, 24: 2, 25: 1, 26: 2, 27: 2, 28: \'Easy course\', 29: \'Continuity\'}','2019-11-14 07:16:35.475283',47),(648,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 1, 22: 1, 23: 1, 24: 2, 25: 1, 26: 2, 27: 2, 28: \'Easy course\', 29: \'Continuity\'}','2019-11-14 07:17:01.236645',48),(649,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 3, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 1, 25: 1, 26: 1, 27: 3, 28: \'Take if interested in MD simulations\', 29: \'Deep understanding of concepts\'}','2019-11-14 07:17:08.806393',47),(650,'{0: 2, 1: 2, 2: 1, 3: 3, 4: 3, 5: 1, 6: 1, 7: 1, 8: 1, 9: 1, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 19: 1, 20: 2, 21: 2, 22: 3, 23: 2, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'-\', 29: \'-\'}','2019-11-14 07:18:11.685822',43),(651,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 2, 6: 2, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 3, 20: 2, 21: 2, 22: 3, 23: 2, 24: 3, 25: 2, 26: 1, 27: 3, 28: \'-\', 29: \'-\'}','2019