. Related to the term papers we had very less was taught with respect to the question asked in term paper. Some slides had an overview of the topic rather than explaining the content completely.Much more could be added to slides\', 29: \'Explain more related to the term papers students have. Rest in the course was fine.The topics were interesting enough\'}','2020-01-06 12:54:05.742671',60),(853,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 3, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 3, 19: 1, 20: 2, 21: 3, 22: 1, 23: 2, 24: 2, 25: 1, 26: 2, 27: 3, 28: \'Consider this only if you have interest in human sciences.\', 29: \'The way of teaching was good.\'}','2020-01-06 12:54:05.747109',60),(854,'{1: 1, 4: 3, 8: 3, 9: 3, 10: 3, 11: 2, 12: 2, 14: 3, 17: 5, 19: 3, 20: 1, 26: 1, 28: \"Don\'t take this course, instead take a course more focused on something you like. This course tries to become something good, but ultimately fails due to  poor course structure.\", 29: \'Please being uptight and start making things interesting for students.\'}','2020-01-06 12:54:05.751437',60),(855,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 2, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 2, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'Take the course if you are really interested in humanities and social sciences.\', 29: \'Interactive activities and discussions in the class\'}','2020-01-06 12:54:05.767981',60),(856,'{0: 2, 1: 2, 2: 1, 3: 1, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 3, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'Interesting course. But its a core course, no option but to take it.\', 29: \'Asking all students to attend all the different classes did not make sense as it lead to students not being interested in the sciences which they didnt opt for. It would have made sense if students only had to attend the 3 sciences they opted for thus sustaining interest and reducing class fatigue in other human science classes \'}','2020-01-06 12:54:05.774564',60),(857,'{0: 3, 1: 1, 2: 3, 3: 4, 4: 3, 5: 2, 6: 2, 7: 2, 8: 3, 9: 3, 10: 2, 11: 2, 12: 2, 13: 3, 14: 3, 15: 3, 16: 3, 17: 5, 18: 3, 19: 3, 20: 1, 21: 3, 22: 3, 23: 3, 24: 2, 25: 1, 26: 2, 27: 5, 28: \'N. A\', 29: \'N. A\'}','2020-01-06 12:54:05.778836',60),(858,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 3, 23: 2, 24: 2, 25: 2, 26: 2, 27: 2, 28: \'Take it \', 29: \'No comments\'}','2020-01-06 12:54:05.782906',60),(859,'{0: 2, 1: 2, 2: 1, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 1, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 3, 19: 2, 20: 2, 21: 2, 22: 3, 23: 3, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'None\', 29: \'None\'}','2020-01-06 12:54:05.787318',60),(860,'{0: 3, 1: 1, 2: 3, 3: 5, 4: 3, 5: 2, 6: 2, 7: 2, 8: 3, 9: 3, 10: 3, 11: 2, 12: 2, 13: 3, 14: 3, 15: 3, 16: 3, 17: 5, 18: 3, 19: 3, 20: 1, 21: 3, 22: 3, 23: 3, 24: 3, 25: 2, 26: 2, 27: 5, 28: \"I don\'t understand why computer science students have to humanities. The course instructors don\'t teach properly and more over expect us to write like a professional. I didn\'t feel that this was an introductory course but was just a complete mess.\", 29: \'I believe classes should be made more discussion oriented. And instructors should expect students who want understand the basics rather some professionals.\'}','2020-01-06 12:54:05.791148',60),(861,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 1, 25: 1, 26: 2, 27: 2, 28: \'Good course.\', 29: \'Discussion with students.\'}','2020-01-06 12:54:05.795201',60),(862,'{0: 2, 1: 2, 2: 3, 3: 5, 4: 3, 5: 2, 6: 2, 7: 2, 8: 2, 9: 3, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 3, 18: 3, 19: 2, 20: 2, 21: 3,