approach may benefit the students more. \'}','2020-01-06 12:54:06.374472',56),(963,'{0: 2, 1: 2, 2: 3, 3: 4, 4: 1, 5: 1, 6: 2, 7: 1, 8: 2, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 3, 22: 1, 23: 2, 24: 1, 25: 1, 26: 2, 27: 3, 28: \'A lot of self learning will be required\', 29: \'Needed some in depth discussion\'}','2020-01-06 12:54:06.379111',56),(964,'{0: 1, 1: 1, 2: 1, 3: 1, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 1, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 1, 20: 2, 21: 2, 22: 3, 23: 2, 24: 1, 25: 1, 26: 2, 27: 2, 28: \'You should have a good understanding of linear algebra, probability and statistics to get a good understanding of the topics being covered. \', 29: \'The instructor had a good understanding of the contents and formulated not only a technical but also an intuitive understanding of the topics which helped in understanding the concepts very well.\'}','2020-01-06 12:54:06.384000',56),(965,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 1, 5: 2, 6: 1, 7: 1, 8: 1, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 3, 17: 1, 18: 3, 19: 3, 20: 2, 21: 2, 22: 3, 23: 3, 24: 1, 25: 2, 26: 1, 27: 3, 28: \"Extreme bias on Avinash\'s side while grading of projects. Unnecessarily lose grades. \", 29: \'Anoop did a great job with course instruction, his classes provided a lot of intuition and built ideas. Avinash\\\'s classes lacked any intuition whatsoever while he tried to \\\'impart\\\' mathematical knowledge which was hand-waved most of the time. Projects were assigned by avinash and yet he had a problem with the scope of the problem and came up with an unrealistic expectation that students should have complained about the scope. Also, Avinash\\\'s project evaluation itself was quite unprofessional asking things like \"what\\\'s your cgpa\" during it. \'}','2020-01-06 12:54:06.388003',56),(966,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 1, 5: 1, 6: 2, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 26: 2, 28: \'Try to do good projects\', 29: \'More class interaction\'}','2020-01-06 12:54:06.391999',56),(967,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 2, 5: 1, 6: 1, 7: 2, 8: 2, 9: 3, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 3, 20: 2, 21: 2, 22: 3, 23: 2, 24: 1, 25: 1, 26: 2, 27: 1, 28: \'This course is completely off topic to general things that we learn as computer science students. Should be taken only if interested as it requires extra effort\', 29: \'Assignment evaluation timing should be notified atleast couple.of days back instead on same day\'}','2020-01-06 12:54:06.396970',56),(968,'{0: 3, 1: 3, 2: 2, 3: 4, 4: 2, 5: 1, 6: 1, 7: 2, 8: 2, 9: 3, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 3, 17: 3, 18: 3, 19: 1, 20: 2, 21: 2, 22: 2, 23: 3, 24: 1, 25: 1, 26: 1, 27: 4, 28: \"DON\'T IF YOU CARE ABOUT YOUR TIME. TOO LITTLE FOR TOO MUCH EFFORT\", 29: \'More planning should be involved in the course layout and also how the assignments and projects are managed. The course has too many evaluation components which can bother the student who wants to do research or something else parallely. \'}','2020-01-06 12:54:06.400736',56),(969,'{0: 2, 1: 2, 2: 3, 3: 4, 4: 3, 5: 2, 6: 2, 7: 2, 8: 3, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 3, 17: 4, 18: 2, 19: 3, 20: 1, 21: 3, 22: 3, 23: 2, 24: 1, 25: 1, 26: 2, 27: 5, 28: \'Lot of things to learn\\r\\nBut u hav to do by ur own\', 29: \'Plz explain topics from basics with moderate pace.\'}','2020-01-06 12:54:06.404519',56),(970,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 1, 5: 1, 6: 1, 7: 2, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 3, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 1, 25: 1, 26: 2, 27: 2, 28: \'-\', 29: \'-\'}','2020-01-06 12:54:06.408731',56),(971,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 3, 17: 1, 18: 2, 19: 2, 20: 3, 21: 2, 22: 2, 23: 2, 24: 1, 25: 1, 26: 2, 27: 1, 28: \'Take only if you are really interested.\', 29: \'Clear understanding of what he is teaching.\'}','2020-01-06 12:54:06.412516',56),(972,'{0: 3, 1: 2, 2: 2, 3: 3, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 1, 11: 1, 12: 2, 13: 2, 14: 1, 15: 1, 16: 2, 17: 3, 18: 3, 19: 1, 20: 2, 21: 3, 22: 2, 23: 1, 24: 2, 25: 1, 26: 2, 27: 2, 28: \'Really an excellent course. We can explore deeply in Computer Vision. \', 29: \'Instructor way teaching very nice but the only problem with him is never shared the material which taught in class.\'}','2020-01-06 12:54:06.416816',56),(973,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 1, 5: 2, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 3, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 1, 25: 1, 26: 2, 27: 1, 28: \'You are on your own, TAs wont reply or help you in assignments, sir wont provide lecture slides. The course is interesting though.\', 29: \'The way that the teacher tries to make the things clear is awesome. It is very easy to understand things being taught. But not providing lecture slides is such a worse idea even after being reminded several times in class.\'}','2020-01-06 12:54:06.434036',56),(974,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 1, 5: 1, 6: 2, 7: 2, 8: 2, 9: 2, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 2, 16: 3, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 1, 25: 1, 26: 2, 27: 2, 28: \'Quite a heavy course, you can have a lot of fun if you are motivated.\', 29: \'Class schedule should be made available in prior so that we can prepare accordingly for each lecture. Slides could be made available too so that we can concentrate completely on the lecture and not get distracted while taking notes. TA evaluations for assignments couldve been more professional, there was a lot of ambiguity and plagiarism that went unnoticed.\'}','2020-01-06 12:54:06.438322',56),(975,'{0: 3, 1: 1, 2: 2, 3: 3, 4: 2, 5: 2, 6: 2, 7: 2, 8: 2, 9: 3, 10: 1, 11: 1, 12: 2, 13: 1, 14: 1, 15: 2, 16: 3, 17: 4, 18: 3, 19: 3, 20: 1, 21: 2, 22: 1, 23: 1, 24: 2, 25: 1, 26: 2, 27: 4, 28: \'Most of self learning involved in this course. Be ready to allot most of the time to this course. Should know digital image processing and smai and probability and linear algebra before.\\r\\nSimultaneously do online courses on cv as class is mostly rushed and nothing is taught in proper way to be implemented.\', 29: \"1. Anoop sir explained things from basics.\\r\\n2. Avinash sir was very timely and punctual.\\r\\nCons:-\\r\\n1. Anoop sir doesn\'t help with any resources after the class. He would kinda disappear after the class.\\r\\n2. Avinash sir thinks that all students are some postdoc level students, and he uses some mathematical jargon and which no one knows about. Rather than skimming the course if he would concentrate on teaching small things well, then it would be better\"}','2020-01-06 12:54:06.442394',56),(976,'{0: 2, 1: 2, 2: 2, 3: 1, 4: 1, 5: 1, 6: 1, 7: 2, 8: 2, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 1, 18: 2, 19: 1, 20: 2, 21: 3, 22: 1, 23: 2, 24: 1, 25: 1, 26: 2, 27: 1, 28: \'Make sure you make a continuous and consistent effort.\\r\\nMake sure to spend as much time as possible because the learning can be immense.\', 29: \'As a course, it was brilliant to have had the opportunity to learn so much. The assignments and project were good motivators to understand the theoretical aspects much deeper.\\r\\nDr. Anoop :\\r\\nVery engaging classes and neatly spaced explanations.\\r\\nHis openness to questions and careful understanding of them to provide apt insights is admirable.\\r\\n\\r\\nDr. Avinash:\\r\\nClasses would be more effective if the focus on mathematical aspects is secondary to the explanation of the computer vision aspects.\'}','2020-01-06 12:54:06.447894',56),(977,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1, 26: 2, 27: 1, 28: \"This course provides a pathway or overview of the filed of 