e skill in this world, not just for Machine Learning. Do take this course!\', 29: \'The idea of on-demand assignments was a brilliant one, something I would surely adopt if I do become a prof.\\r\\nHowever, having last minute project and term paper introduced into the course defeated the point of the assignments and for giving time to self to do the course.\'}','2020-01-06 12:54:07.561975',55),(1175,'{0: 1, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 3, 18: 3, 19: 2, 20: 2, 21: 2, 22: 3, 23: 3, 24: 2, 25: 1, 26: 2, 27: 3, 28: \'I would have understood better about the subject through self teaching.\', 29: \"Good thinking about the course during start of semester, but, really bad implementation of the ideas, gave assignments with huge weightage in the last 3 weeks of the semester, doesn\'t make sense to me.\"}','2020-01-06 12:54:07.566446',55),(1176,'{0: 3, 1: 2, 2: 1, 3: 2, 4: 1, 5: 2, 6: 2, 7: 2, 8: 3, 9: 3, 10: 2, 11: 1, 12: 2, 13: 3, 14: 1, 15: 1, 16: 3, 17: 2, 18: 3, 19: 3, 20: 3, 21: 3, 22: 3, 23: 3, 24: 2, 25: 1, 26: 2, 27: 5, 28: \'instructor and TA made this course harder \', 29: \'Need to cover topics in depth with examples and for harder assignments and exams questions need to make students prepare for it\'}','2020-01-06 12:54:07.584600',55),(1177,'{0: 2, 1: 2, 2: 2, 3: 1, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 1, 18: 3, 19: 3, 20: 2, 21: 3, 22: 2, 23: 3, 24: 1, 25: 1, 26: 2, 27: 2, 28: \'Good\', 29: \'Proper time allocated for each topics\'}','2020-01-06 12:54:07.589433',55),(1178,'{0: 3, 1: 3, 2: 1, 3: 1, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 1, 11: 1, 12: 2, 13: 2, 14: 1, 15: 1, 16: 3, 17: 1, 18: 2, 19: 3, 20: 2, 21: 3, 22: 3, 23: 2, 24: 2, 25: 1, 26: 2, 27: 1, 28: \'Requires extra effort beyond whats taught in class\', 29: \'Assignments on time\'}','2020-01-06 12:54:07.593569',55),(1179,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 