el exam paper. The questions were very well.\'}','2020-01-06 12:54:09.201695',54),(1456,'{0: 3, 1: 3, 2: 2, 3: 3, 4: 2, 5: 2, 6: 2, 7: 2, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 3, 18: 2, 19: 2, 20: 1, 21: 3, 22: 1, 23: 1, 24: 1, 25: 1, 26: 1, 27: 3, 28: \'Get introduced a bit to machine learning to keep yourself in pace with the course. \', 29: \'The students are new to the topics you are teaching, though you wanted to give the complete view of the subject, it becomes difficult for the newbies to understand the complete picture in such short span of time.\\r\\nAlso, i would like to Thank you for your efforts. \'}','2020-01-06 12:54:09.206397',54),(1457,'{0: 3, 1: 3, 2: 2, 3: 4, 4: 2, 5: 1, 6: 2, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 1, 20: 2, 21: 3, 22: 2, 23: 2, 24: 2, 25: 1, 26: 1, 27: 2, 28: \'If good in statistics and maths then welcome\', 29: \'Introduction in every ml topic\'}','2020-01-06 12:54:09.213400',54),(1458,'{0: 3, 1: 2, 2: 3, 3: 4, 4: 1, 5: 2, 6: 2, 7: 2, 8: 2, 9: 3, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 1, 21: 2, 22: 1, 23: 3, 24: 1, 25: 1, 26: 1, 27: 3, 28: \'Check moss before submitting the assignments. Not all assignments are doable on our own, so sometimes it becomes a necessary evil to copy some things. The problem is that such an intuition heavy course do not have any consideration for such cases. So copy at your own risk.\', 29: \'The way of lecture delivery was good for the 1st hour of the class. After that the prof used to rush things just to complete the slides. This is not a good way of teaching. RNN + LSTM + GRU were covered in a single lecture.\'}','2020-01-06 12:54:09.218010',54),(1459,'{0: 2, 1: 2, 2: 1, 3: 1, 4: 1, 5: 1, 6: 2, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 3, 14: 1, 15: 1, 16: 1, 17: 1, 18: 3, 19: 3, 20: 2, 21: 2, 22: 2, 23: 3, 24: 1, 25: 1, 26: 1, 27: 1, 28: \'Amazing course\', 29: \'Please be more interactive with the class\'}','2020-01-06 12:54:09.222758',54),(1460,'{0: 3, 1: 3, 2: 1, 3: 1, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 19: 1, 20: 3, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1, 26: 2, 27: 1, 28: \'It is one of the best courses for aspiring for path in AI\', 29: \'Instructor has been very empathetic and helpful in getting through this tough course. The TA community was selected well for doing the job.\'}','2020-01-06 12:54:09.228763',54),(1461,'{0: 3, 1: 3, 2: 2, 3: 3, 4: 1, 5: 1, 6: 2, 7: 2, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 3, 18: 2, 19: 3, 20: 2, 21: 3, 22: 2, 23: 2, 24: 1, 25: 1, 26: 2, 27: 3, 28: \'Course is good, but amount of effort required is too high, so take other subjects accordingly.\', 29: \'Frequecy of assignments should be less, so that we can focus on few topics but learning will be good, instead of focusing on too many topics\'}','2020-01-06 12:54:09.232742',54),(1462,'{0: 3, 1: 3, 2: 3, 3: 3, 4: 2, 5: 2, 6: 2, 7: 2, 8: 2, 9: 3, 10: 1, 11: 1, 12: 2, 13: 2, 14: 1, 15: 1, 16: 2, 17: 3, 18: 3, 19: 3, 20: 3, 21: 3, 22: 2, 23: 2, 24: 1, 25: 1, 26: 1, 27: 3, 28: \"This course is a lot hectic.If considering to take this course be prepared to a lot of self study.And most probably you won\'t be able to focus on other courses.\", 29: \"The pace of the course was bit too fast. Only starting 20 mins of class we were able to focus, rest of the class bounced off of our head.\\r\\nAlthough this is an elective course, but instructor should have considered student\'s other courses too. because of this course,other course assignments were affected.\"}','2020-01-06 12:54:09.636680',54),(1463,'{0: 2, 1: 2, 2: 1, 3: 1, 4: 1, 5: 1, 6: 2, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 3, 14: 1, 15: 1, 16: 1, 17: 1, 18: 3, 19: 3, 20: 2, 21: 2, 22: 2, 23: 3, 24: 1, 25: 1, 26: 1, 27: 1, 28: \'Amazing course\', 29: \'Please be more interactive with the class\'}','2020-01-06 12:54:09.646079',54),(1464,'{0