 12: 1, 13: 2, 14: 1, 15: 2, 16: 2, 17: 3, 18: 3, 19: 3, 20: 1, 21: 2, 22: 2, 23: 2, 24: 3, 25: 1, 26: 2, 27: 4, 28: \"Don\'t \", 29: \'Reduce course content so that the material that is covered, is done so properly\'}','2020-01-06 12:54:10.434884',50),(1611,'{0: 2, 1: 1, 2: 1, 3: 5, 4: 3, 5: 2, 6: 2, 7: 1, 8: 2, 9: 3, 10: 1, 11: 1, 12: 1, 13: 2, 14: 2, 15: 1, 16: 1, 17: 3, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 1, 24: 3, 25: 1, 26: 2, 27: 4, 28: \"It\'s better that you learn all these things on your own, because that\'s what you\'ll anyway need to do. This is not because of the Instructors\' incompetence, but because of poor planning. The couse is too rushed. And there were important components like JavaScript, jQuery etc. For which we even didn\'t have a dedicated assignment. And as a result we couldn\'t learn much.\", 29: \"Effective: The scope of things covered\\r\\nSuggestions: Plan out the course better. Remove the lab assignments. Dedicate the full time of lab to learning and practicing.\\r\\nDon\'t give assignments to improve your pet projects like Virtual Labs, instead give assignments to supplement our learning. The third assignment should have been on JavaScript, jQuery and AJAX. To teach github, you could have asked us to submit that assignment on git. Effectively, the third assignment didn\'t teach us anything, whereas getting an assignment on jQuery would have taught us a lot\"}','2020-01-06 12:54:10.438813',50),(1612,'{0: 2, 1: 1, 2: 3, 3: 4, 4: 3, 5: 2, 6: 2, 7: 2, 8: 2, 9: 3, 10: 3, 11: 1, 12: 1, 13: 3, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 1, 21: 2, 22: 1, 23: 1, 24: 2, 25: 1, 26: 2, 27: 3, 28: \'Set aside a lot of time for this course as it is very time consuming\', 29: \"The scope of the course covers very important and state of the art concepts. Therefore rushing over them within half a semester not only pressurizes the students with huge workload, it also discourages students to explore these subjects further. I suggest that the course should be spread out over 2 semesters wherein the first sem covers the preliminary topics, which allows the student to get a good introduction and by the next sem, a very good base in order to take a shot at the advanced topics. I really feel this is a wonderful course, but it\'s right implementation is equally necessary. Thank you\"}','2020-01-06 12:54:10.444848',50),(1613,'{0: 3, 1: 3, 2: 3, 3: 5, 4: 3, 5: 1, 6: 1, 7: 1, 8: 3, 9: 2, 10: 1, 11: 1, 12: 1, 13: 3, 14: 1, 15: 1, 16: 2, 17: 5, 18: 2, 19: 2, 20: 1, 21: 3, 22: 3, 23: 2, 24: 3, 25: 1, 26: 2, 27: 5, 28: \"Useless course, don\'t know where we\'ll use it\", 29: \'Teach things with proper logic and explanations, make classes interesting, teach something we might use at least somewhere\'}','2020-01-06 12:54:10.456346',61),(1614,'{0: 1, 1: 1, 2: 3, 3: 5, 4: 3, 5: 2, 6: 2, 7: 2, 8: 3, 9: 3, 10: 1, 11: 1, 12: 2, 13: 3, 14: 2, 15: 2, 16: 3, 17: 5, 18: 3, 19: 3, 20: 1, 21: 3, 22: 2, 23: 2, 24: 3, 25: 2, 26: 2, 27: 2, 28: \'Dont\', 29: \'Nothing\'}','2020-01-06 12:54:10.464285',61),(1615,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 1, 25: 1, 26: 1, 27: 1, 28: \'Compulsory course\', 29: \'Little less theory\'}','2020-01-06 12:54:10.472965',61),(1616,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 2, 5: 1, 6: 1, 7: 2, 8: 2, 9: 2, 10: 2, 11: 2, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'I\', 29: \'I\'}','2020-01-06 12:54:10.476995',61),(1617,'{0: 3, 1: 3, 2: 3, 3: 5, 4: 3, 5: 2, 6: 2, 7: 2, 8: 3, 9: 3, 10: 3, 11: 2, 12: 2, 13: 3, 14: 3, 15: 3, 16: 3, 17: 5, 18: 3, 19: 3, 20: 3, 21: 3, 22: 3, 23: 3, 24: 3, 25: 2, 26: 2, 27: 5, 28: \'Poor\', 29: \'Poor\'}','2020-01-06 12:54:10.481046',61),(1618,'{0: 3, 1: 3, 2: 3, 3: 5, 4: 3, 5: 2, 6: 2, 7: 2, 8: 3, 9: 3, 10: 3, 11: 2, 12: 2, 13: 3, 14: 3, 15: 3, 16: 3, 17: 5, 18: 3, 19: 3, 20: 1, 21: 3, 22: 3, 23: 3