, 27: 4, 28: \'The course syllabus should be given as prerequisites for the course\', 29: \'Instructor hardly thought anything new on his own and most of the time we were asked to learn everything on our own, even when doubts were asked we hardly understood anything as the instructor kept using terms which we were not familiar with at all. Hence the explanation itself was an another doubt. I personally hardly understood anything what he said. As everything seemed beyond my scope. It was very hard to keep up with the class as few of them knew these topics ahead of time and the rest were felt to deal with it themselves.\'}','2020-01-06 12:54:10.668370',50),(1657,'{0: 3, 1: 3, 2: 3, 3: 5, 4: 3, 5: 2, 6: 2, 7: 2, 8: 3, 9: 3, 10: 3, 11: 2, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 5, 19: 3, 20: 1, 21: 3, 22: 2, 23: 2, 24: 1, 25: 1, 26: 1, 27: 5, 28: \'Very bad\', 29: \'Teach atleast the basic clearly\'}','2020-01-06 12:54:10.676034',50),(1658,'{0: 2, 1: 2, 2: 3, 3: 3, 4: 2, 5: 2, 6: 2, 7: 2, 8: 2, 9: 3, 10: 2, 11: 1, 12: 1, 13: 2, 14: 2, 15: 2, 16: 2, 17: 3, 18: 2, 19: 1, 20: 1, 21: 2, 22: 3, 23: 3, 24: 2, 25: 2, 26: 1, 27: 4, 28: \'There is a lot of work to do without much teaching in class. Better sit at your room and learn these things google because that is what you have to do more or less even after taking the course. Everyone just have one thing to say \"Google It\".\', 29: \"Hey was familiar with networking and I was having a lot of doubts in it, so he got them cleared.\\r\\nThe instructor is trying to teach us a lot of things in a very less time which seems too hectic and makes students learn things only superficially where they are in an illusion that they know things but in reality they don\'t as they never got any time from there assignment to explore the subject. I am not at all saying that the topics should not be covered in the first year but my point is they should not be covered in one semester. They should be split into two parts which should be covered in 