nderstanding of students.\\r\\nMissing lectures seems too punishing as a lot of content is covered in a single class (perhaps because of the time constraint). Therefore, unintentional absences prove costly.\\r\\n\'}','2020-01-06 12:54:11.284765',76),(1763,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 3, 19: 1, 20: 2, 21: 3, 22: 1, 23: 2, 24: 1, 25: 1, 26: 2, 27: 1, 28: \'Sure go ahead\', 29: \'Norhing to improve.\'}','2020-01-06 12:54:11.378941',98),(1764,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 1, 9: 1, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 1, 20: 2, 21: 2, 22: 1, 23: 3, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'This course is helpful to know the real time problems.\', 29: \"Teaching is very good. And it\'s better to say the syntax of different functions in class.\"}','2020-01-06 12:54:11.384486',98),(1765,'{0: 2, 1: 2, 2: 1, 3: 3, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 2, 25: 2, 26: 2, 27: 3, 28: \'Should take this coarse\', 29: \'Way of teaching is very good\'}','2020-01-06 12:54:11.388734',98),(1766,'{0: 2, 1: 2, 2: 1, 3: 4, 4: 2, 5: 1, 6: 2, 7: 1, 8: 2, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 2, 24: 1, 25: 1, 26: 2, 27: 3, 28: \'Should be prepared with the arithmetic and should spend time on it\', 29: \'Very good at explaining but there is alot to go through\'}','2020-01-06 12:54:11.393569',98),(1767,'{0: 1, 1: 2, 2: 1, 3: 3, 4: 3, 5: 2, 6: 1, 7: 2, 8: 2, 9: 3, 10: 1, 11: 1, 12: 2, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 3, 19: 2, 20: 2, 21: 3, 22: 3, 23: 3, 24: 3, 25: 1, 26: 2, 27: 4, 28: \'Yeah you can take it if at all you are very much interested in and feel this might be helpful for ur job or research only!\', 29: \'Way of teaching is way too good\\r\\nLittle tough for the students to take who all are from non cse so there can be qstns and applications of python related to our subject\'}','2020-01-06 12:54:11.397872',98),(1768,'{0: 2, 1: 3, 2: 1, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 3, 25: 1, 26: 1, 27: 2, 28: \'You can take to improve your thinking skills and approaches towards a problem.\', 29: \'Makes us the importance to learn the subject or topic.\'}','2020-01-06 12:54:11.401938',98),(1769,'{0: 1, 1: 2, 2: 1, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 1, 9: 1, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 3, 20: 2, 21: 2, 22: 3, 23: 3, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'Very basic course for learning the logic of programming. \', 29: \'The time given for explanation was nice. Takes time to explain basic and working of things. Stimulates think in students but more needs to be covered in course and more frequently assignments need to be given. \'}','2020-01-06 12:54:11.406102',98),(1770,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 3, 20: 2, 21: 2, 22: 3, 23: 3, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'Practice is to be done by own, and not just wait for assignments. The course is informative and helpful in understanding the basic behind problem solving \', 29: \'More focus on logic, which is good and requisite. \\r\\nSuggestions- more frequent assignment in every class to be solved and uploaded on Moodle will help students gather better grip of syntaxes and all. And innovative problems in LAB classes will compel us to think and devise new ways to solve them. \'}','2020-01-06 12:54:11.410406',98),(1771,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 1, 5: 1, 6: 2, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 3, 23: 3, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'I would like to say that you should have atleast basic coding and logi