: 1, 25: 1, 26: 2, 27: 5, 28: \'the course is pretty confusing\', 29: \"he\'s very focused on people who win prizes and opening companies and stuff like that\"}','2020-01-06 12:54:13.389544',105),(2100,'{0: 3, 1: 2, 2: 3, 3: 4, 4: 2, 5: 2, 6: 2, 7: 2, 8: 2, 9: 3, 10: 3, 11: 2, 12: 2, 13: 3, 14: 2, 15: 1, 16: 2, 17: 4, 19: 3, 20: 1, 21: 3, 23: 2, 24: 3, 25: 1, 26: 1, 27: 4, 28: \'Be prepared to study everything by your self\', 29: \'Lacks in teaching skills,many a times instructor  gets confused while solving questions, further confusing us\'}','2020-01-06 12:54:13.394501',131),(2101,'{0: 2, 1: 2, 2: 2, 3: 4, 4: 3, 5: 2, 6: 1, 7: 1, 8: 2, 9: 3, 10: 2, 11: 2, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 3, 19: 2, 20: 2, 21: 3, 23: 2, 24: 2, 25: 2, 26: 2, 27: 3, 28: \'Class is not much intresting\', 29: \'we can simply learn from the classes given in the MIT ocw rather from class by prof\\r\\nQuestions given in the quizzes are not even properly explained by the prof in the same time given to us during examination\\r\\nThere is no much coordination among prof and TAs that they are simply checking answers and not the method in which prof explained during class\'}','2020-01-06 12:54:13.399442',131),(2102,'{0: 2, 1: 2, 2: 2, 3: 4, 4: 3, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 2, 11: 2, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 4, 18: 3, 19: 3, 20: 2, 21: 2, 22: 1, 23: 2, 24: 3, 25: 1, 26: 1, 27: 2, 28: \'The course is good, enough topics covered. The professor is not very well versed in teaching, but he is quite friendly and responsive. So there will often be blanks in a lecture, but can be filled by approaching the professor.\', 29: \"The idea of having quizzes based on a given set of solved and unsolved problems was promising, but not well implemented (questions in quizzes were often calculative, when they\'d rather be more conceptual). \\r\\nContent was explained somewhat poorly, the instructor should rather have a more constructed approach.\"}','2020-01-06 12:54:13.416733',131),(2103,'{0: 3, 1: 2, 2: 3, 3: 4, 4: 2, 5: 2, 6: 1, 7: 1, 8: 2, 9: 3, 10: 2, 11: 2, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 3, 18: 3, 19: 1, 20: 1, 21: 3, 22: 2, 23: 1, 24: 2, 25: 1, 26: 2, 27: 4, 28: \'Self learning nthg will b taught. Listen to OCW lectures much better than the original classes \', 29: \'Repeating the same mit course. All the course material is a copy of that. Probability should be an intuitive course but not a science course. Learning the practice problems and the same problems showing up in the exam is not good. Better to play Ocw lectures in the class instead of watching the instructor confused .\'}','2020-01-06 12:54:13.458301',131),(2104,'{0: 3, 1: 2, 2: 3, 3: 5, 4: 3, 5: 2, 6: 2, 7: 2, 8: 3, 9: 3, 10: 3, 11: 2, 12: 2, 13: 3, 14: 2, 15: 3, 16: 3, 17: 5, 18: 3, 19: 1, 20: 3, 21: 3, 22: 3, 23: 2, 24: 3, 25: 2, 26: 1, 27: 5, 28: \'You will need to self learn everything.\', 29: \'Much is needed to be improved. The just comes delivers and goes. \'}','2020-01-06 12:54:13.462906',131),(2105,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 1, 5: 2, 6: 2, 7: 1, 8: 2, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 3, 19: 2, 20: 2, 21: 3, 22: 3, 23: 2, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'Do  questions from the textbook which will give you a good idea of what to expect in the course . Some of the topics are a bit difficult to get without practice , and there will be not much time to practice in the semester\', 29: \"He was organized , and had office hours which were useful . He always wanted to make sure that the students do well. He had high standards for students . However the correction by TAs was harsh almost binary and I dont think the prof looked solved the questions before giving it .I feel the paper corrections was not fair . It heavily depended on the TA . The prof promised that he would give 4 to 6 unsolved questions and ask 2 out of them for the quiz. But from quiz 3 onwards 10-15 questions were given . There was not enough time to do these questions . \