ow for algorithmists and data scientists\', 29: \"Discussions and slides we\'re concise and helpful\"}','2020-01-06 12:54:13.702220',85),(2146,'{0: 2, 1: 2, 2: 2, 3: 5, 4: 2, 5: 1, 6: 1, 7: 2, 8: 2, 9: 3, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 1, 20: 2, 21: 2, 22: 2, 23: 2, 24: 1, 25: 2, 26: 1, 27: 3, 28: \'Need to do a lot of talking \', 29: \"Please allow discussion that might be against the prof\'s points of view \"}','2020-01-06 12:54:13.709181',85),(2147,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 1, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 1, 18: 2, 19: 1, 20: 2, 21: 2, 22: 1, 23: 2, 24: 1, 25: 1, 26: 1, 27: 1, 28: \"It\'s fun\", 29: \'The freedom of opinion and cool discussion\'}','2020-01-06 12:54:13.717630',85),(2148,'{0: 2, 1: 2, 2: 2, 3: 4, 4: 2, 5: 1, 6: 1, 7: 2, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1, 26: 2, 27: 3, 28: \'Participate in class and try to learn from the discussions rather than books.\', 29: \"The discussions are great but it would be better if the topics weren\'t so random. This would help in better flow and understanding of each topic.\"}','2020-01-06 12:54:13.725842',85),(2149,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 1, 21: 2, 22: 1, 23: 3, 24: 1, 25: 1, 26: 2, 27: 2, 28: \"I would suggest to take if the student is interested in spending a lot of time on one project. The only evaluation in the course is a quiz and a project. So you have to do very well in those. But overall it\'s a good course. Gained some good insights about HCI that made me think further. \", 29: \'Promoted discussion in class\'}','2020-01-06 12:54:13.733910',85),(2150,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 1, 9: 1, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1,