was elaborative which made understanding the course easy.\'}','2020-01-06 12:54:14.148094',115),(2229,'{0: 2, 1: 2, 2: 3, 3: 5, 4: 2, 5: 2, 6: 2, 7: 2, 8: 3, 9: 3, 10: 3, 11: 1, 12: 1, 13: 2, 14: 2, 15: 1, 16: 1, 17: 3, 18: 2, 19: 2, 20: 1, 21: 2, 22: 1, 23: 3, 24: 1, 25: 1, 26: 1, 27: 3, 28: \'Need self - learning. Classes are not that good and even sometimes not understandable due to accent of the teacher.\', 29: \'Please try working on improving your accent. And focus more on mathematical part.\'}','2020-01-06 12:54:14.162319',95),(2230,'{0: 2, 1: 2, 2: 1, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 1, 20: 2, 21: 2, 22: 2, 23: 1, 24: 1, 25: 2, 26: 2, 27: 1, 28: \'Interesting course with helpful teaching faculty. \', 29: \'Helped in understand where or how I might be losing marks and asking me to come to him if I ever have doubts. Gave timings for when he would be free.\'}','2020-01-06 12:54:14.166667',115),(2231,'{0: 2, 1: 2, 2: 1, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 1, 20: 2, 21: 2, 22: 2, 23: 1, 24: 1, 25: 2, 26: 2, 27: 1, 28: \'Interesting course with helpful teaching faculty. \', 29: \'Helped in understand where or how I might be losing marks and asking me to come to him if I ever have doubts. Gave timings for when he would be free.\'}','2020-01-06 12:54:14.170644',115),(2232,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 1, 5: 1, 6: 1, 7: 2, 8: 2, 9: 2, 10: 2, 11: 2, 12: 1, 13: 1, 14: 2, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 2, 25: 1, 26: 2, 27: 2, 28: \'Effective usage of the class time might not be done.\', 29: \'Over explanation and under explanation of few topics.\'}','2020-01-06 12:54:14.174723',66),(2233,'{0: 2, 1: 3, 2: 1, 3: 3, 4: 2, 5: 2, 6: 1, 7: 1, 8: 1, 9: 2, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 3, 25: 2, 26: 2, 27: 1, 28: \"I think it\'s a good beginners course only if you\'ve taken one course before. Otherwise I\'d say there is a bad adjustment period for the course.\", 29: \'I would want some reading material, to formalise the arguments.\\r\\nProf gives good examples though.\'}','2020-01-06 12:54:14.178665',115),(2234,'{0: 2, 1: 2, 2: 2, 3: 4, 4: 1, 5: 2, 6: 2, 7: 2, 8: 2, 9: 3, 10: 2, 11: 1, 12: 1, 13: 3, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 3, 20: 2, 21: 2, 22: 2, 23: 1, 24: 2, 25: 1, 26: 2, 27: 3, 28: \'Be aware of what you are in for. Know a little about the syllabus and the teachers expect you to be fluent in English, not only speech or reading but also writing and analysis to a very high level. You are also expected to be atleast familiar with junior College social science syllabus.\', 29: \'He did provide constructive criticism for assignment 1 and our exams but sometimes his advice was not understandable or helpful. He could pause in the middle of his lectures to allow doubts and now taking and also making his lectures segmented and well paced. The inter connections of topics is sometimes not stressed or discussed enough. The distribution of importance of the topics within a lecture is not at all clear. As a student without a HSS background, it is very difficult to take notes and now even more due to the absence of lecture slides. I still respect his decisions in all aspects due to his experience and because he had designed the course but just want to be clear on my opinion at the same time.\'}','2020-01-06 12:54:14.183114',115),(2235,'{0: 2, 1: 3, 2: 2, 3: 4, 4: 3, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 3, 14: 1, 15: 1, 16: 1, 17: 4, 18: 2, 19: 2, 20: 1, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1, 26: 2, 27: 4, 28: \'SCOPE OF LEARNING ONLY IF YOU HAVE INTEREST\', 29: \'CLASS SHOULD BE MORE INTERACTVE\'}','2020-01-06 12:54:14.188169',95),(2236,'{0: 2, 1: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 1, 11: 1, 12: 1, 14: 1, 17: 3, 19: 2, 20: 2, 26: 1, 28: \'No\', 29: \'No\'}','2020-01-06 1