ourse if you are good at Maths.\\r\\nCoz regardless of what os being taught in class, exam will be mostly based on maths.\', 29: \"Please provide notes or atleast gives reference material- making notes is class takes time from actually understanding the material.\\r\\nIt\'s good that you recall last lecture\'s material. I am thankful for that.\\r\\n\\r\\nPlease select TA\'s who are impartial and are actually willing to take tutorials.\\r\\nTill date, only 3-4 tuts has happened and even it felt like TA came unprepared.\\r\\n\\r\\nTA is ofcourse knowledge, no doubt, but seems unwilling/lazy to teach.\\r\\nAlso, from the interactions that happened in  those tuts, it seems quite clear that TA is very much partial towards group of people whom he knows.\\r\\n\"}','2020-01-06 12:54:14.312681',93),(2260,'{0: 2, 1: 2, 2: 1, 3: 1, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 3, 19: 3, 20: 2, 21: 3, 22: 1, 23: 1, 24: 2, 25: 1, 26: 1, 27: 1, 28: \'Tough but interesting course\', 29: \'Teaches very well and makes classes interesting. Could reduce the work load.\'}','2020-01-06 12:54:14.316715',119),(2261,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 1, 9: 3, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 2, 18: 3, 19: 3, 20: 2, 21: 2, 22: 2, 23: 2, 24: 1, 25: 1, 26: 1, 27: 2, 28: \'Tough course\', 29: \'-\'}','2020-01-06 12:54:14.333680',119),(2262,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 3, 22: 1, 23: 1, 24: 1, 25: 1, 26: 1, 27: 1, 28: \'A lot of work is involved, make sure you keep up with the classwork and readings assigned\', 29: \'Communication with the class\'}','2020-01-06 12:54:14.337848',119),(2263,'{0: 2, 1: 2, 2: 1, 3: 1, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 3, 19: 2, 20: 2, 21: 2, 22: 2, 23: 3, 24: 2, 25: 1, 26: 2, 27: 1, 28: \'Good Humanities el