topics related to assignments\'}','2020-01-06 12:54:14.759845',94),(2341,'{0: 2, 1: 1, 2: 1, 3: 2, 4: 2, 5: 1, 6: 2, 7: 1, 8: 2, 9: 3, 10: 3, 11: 1, 12: 2, 13: 1, 14: 1, 15: 1, 16: 2, 17: 3, 18: 2, 19: 2, 20: 1, 21: 2, 22: 1, 23: 1, 24: 1, 25: 2, 26: 1, 27: 2, 28: \'Effective course for learning systems.\', 29: \'Reduction of discussions and increase knowledge transfer time.\'}','2020-01-06 12:54:14.768165',94),(2342,'{0: 1, 1: 1, 2: 2, 3: 5, 4: 2, 5: 2, 6: 2, 7: 2, 8: 2, 9: 3, 10: 3, 11: 2, 12: 2, 13: 1, 14: 2, 15: 1, 16: 2, 17: 5, 18: 2, 19: 2, 20: 1, 21: 2, 22: 1, 23: 2, 24: 1, 25: 2, 26: 1, 27: 4, 28: \'Get ready for learning OS yourself. \\r\\nExpect heavy assignments.\\r\\nTheory will not be covered in class.\\r\\nAssignments are the only place where some learning happens.\', 29: \'Cover the topics in a systematic way instead of leaving it for the students to learn themselves.\\r\\nMost students used low quality sources to learn and get by (even score high) in the course.\\r\\nThe graded stuff is too much to leave time for ungraded activities. It is better to make everything graded\\r\\nThe assignments and projects in the course were really helpful in learning. I feel confident in systems programming just because of the assignment.\\r\\nPresentations by students in lieu of quiz/mid sem exam is wastage of time. Most of the times students cannot go to the expected level of detail in the topics covered. \'}','2020-01-06 12:54:14.772348',94),(2343,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 1, 5: 2, 6: 2, 7: 2, 8: 2, 9: 3, 10: 2, 11: 1, 12: 2, 13: 2, 14: 2, 15: 2, 16: 2, 17: 2, 18: 2, 19: 3, 20: 2, 21: 3, 22: 1, 23: 1, 24: 1, 25: 2, 26: 1, 27: 2, 28: \'Assignment will help you learn lot of things try completing them\\r\\n\', 29: \'Got to know any lot of new things other than the book content \\r\\nGetting taught by instructor was more preferable\\r\\nThe classmates were teaching the same old topics in their presentations\'}','2020-01-06 12:54:14.776188',94),(2344,'{0: 2, 1: 1, 2