nt knowledge about your system and know how all things are work in our system.\', 29: \'Imphase for practical knowledge\'}','2020-01-06 12:54:14.890919',94),(2368,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 3, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1, 26: 1, 27: 3, 28: \'Do assignmnts sincerely \', 29: \'Tasks were good\'}','2020-01-06 12:54:14.895500',94),(2369,'{0: 2, 1: 1, 2: 3, 3: 3, 4: 1, 5: 2, 6: 2, 7: 2, 8: 2, 9: 1, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 3, 18: 2, 19: 2, 20: 1, 21: 3, 22: 1, 23: 1, 24: 1, 25: 1, 26: 1, 27: 3, 28: \'Prefer going through basics through standard books and google on your own before coming to class\', 29: \'Applications of the course were explainwd clearly but operating system basic concepts were missed out.\'}','2020-01-06 12:54:14.900973',94),(2370,'{0: 2, 1: 1, 2: 2, 3: 3, 4: 1, 5: 1, 6: 2, 7: 1, 8: 2, 9: 3, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 3, 17: 3, 18: 2, 19: 3, 20: 1, 21: 2, 22: 1, 23: 1, 24: 1, 25: 2, 26: 2, 27: 3, 28: \'Focus on assignments and utilize class hour and TA hour efficiently \', 29: \'Interactive sessions \'}','2020-01-06 12:54:14.905532',94),(2371,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 1, 5: 2, 6: 2, 7: 2, 8: 2, 9: 1, 10: 2, 11: 2, 12: 2, 13: 2, 14: 1, 15: 1, 16: 2, 17: 3, 18: 2, 19: 1, 20: 2, 21: 2, 22: 2, 23: 2, 24: 1, 25: 2, 26: 2, 27: 3, 28: \' \', 29: \' \'}','2020-01-06 12:54:14.911172',94),(2372,'{0: 2, 1: 1, 2: 3, 3: 3, 4: 2, 5: 2, 6: 2, 7: 2, 8: 1, 9: 1, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 3, 20: 1, 21: 2, 22: 1, 23: 1, 24: 1, 25: 2, 26: 1, 27: 3, 28: \'Participate in class discussions as much as possible they wese quite interesting\', 29: \'Practical knowledge\'}','2020-01-06 12:54:14.929141',94),(2373,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 1, 5: 1, 6: 2, 7: 2, 8: 1, 9: 3, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 2, 16: 1, 17: 2, 18: 2, 19: 3, 20: 2, 21: 1, 22: 1, 23: 1, 24: 1, 25: 1, 26: 2, 27: 2, 28: \'Dont expect something to be taught in class. There will only be pointers. Starters of this course should choose another instructor\', 29: \'He is approachable. More of exaggerated Evil than what he is\'}','2020-01-06 12:54:14.953972',94),(2374,'{0: 2, 1: 1, 2: 2, 3: 4, 4: 2, 5: 2, 6: 1, 7: 2, 8: 2, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 3, 18: 3, 19: 2, 20: 2, 21: 2, 22: 1, 23: 2, 24: 2, 25: 1, 26: 2, 27: 4, 28: \'This course is very coding intensive with a difference between the assignments,projects and the actual coursework...Still after that there is a lot of learning from this course\', 29: \'The instructor can be a little more d dictated towards teaching the content of the course...But the way he clears the doubts is very effective...\\r\\n\'}','2020-01-06 12:54:14.958338',94),(2375,'{0: 2, 1: 1, 2: 1, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 1, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 1, 18: 3, 19: 2, 20: 2, 21: 3, 22: 1, 23: 2, 24: 1, 25: 1, 26: 1, 27: 2, 28: \'Considering the current instructor, this will be a very non traditional course. Lot of things outside of the scope of text books were discussed, lot of untraditional reading assignments. Itll be a challenging course\', 29: \'He has a vast pool of knowledge regarding a myriad of topics. Made for interesting classes. But the content covered could have been more focussed on text books, as then it becomes difficult during exams coz you dont know what to cover as syllabus is spread reallllly wide. There are other subjects and assignments too.\'}','2020-01-06 12:54:14.962164',94),(2376,'{0: 1, 1: 1, 2: 1, 3: 4, 4: 1, 5: 2, 6: 2, 7: 2, 8: 2, 9: 2, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 4, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1, 26: 1, 27: 2, 28: \'Change of prof should be considered.\', 29: \'Nothing.\'}','2020-01-06 12:54:14.965987',94),(2377,'{0: 2, 1: 1, 2: 2, 3: 4, 4: 1, 5: 2, 6: 2, 7: 2, 8: 2, 9: 3, 10: 3, 11: 1, 12: 2, 13: 1, 14: 1, 15: 1, 16: 1, 17: 3, 18: 2, 19: 2, 20: 1, 21: 2, 22: 2, 23: 3, 24: 2, 25: 2, 26: 1, 27: 3, 28: \'Study yourself. There was no relation between class theory, project and assignments. You need to be ready for surprises throughout the semester.\', 29: \'He had a good experience in subject area but too much distracted towards other things than actual theory and teaching.\'}','2020-01-06 12:54:14.969731',94),(2378,'{0: 2, 1: 1, 2: 3, 3: 4, 4: 2, 5: 1, 6: 1, 7: 2, 8: 2, 9: 3, 10: 2, 11: 2, 12: 1, 13: 2, 14: 3, 15: 1, 16: 3, 17: 4, 18: 3, 19: 3, 20: 1, 21: 2, 22: 2, 23: 2, 24: 2, 25: 1, 26: 1, 27: 3, 28: \'This course is a mix of concepts and implementations.\', 29: \'Reading assignments\'}','2020-01-06 12:54:14.974360',94),(2379,'{0: 2, 1: 2, 2: 3, 3: 4, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 3, 11: 1, 12: 2, 13: 2, 14: 1, 15: 1, 16: 2, 17: 3, 18: 3, 19: 3, 20: 1, 21: 2, 22: 2, 23: 2, 24: 1, 25: 2, 26: 1, 27: 4, 28: \'-\', 29: \"He tried his best to focus more on learning rather than just marks, but again used marks to force on it. Also the methods though good on paper, weren\'t really effective and only induce fear and pressure\"}','2020-01-06 12:54:14.978400',94),(2380,'{0: 2, 1: 2, 2: 2, 3: 1, 4: 1, 5: 2, 6: 1, 7: 2, 8: 1, 9: 3, 10: 1, 11: 1, 12: 2, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 3, 19: 2, 20: 2, 21: 2, 22: 1, 23: 2, 24: 1, 25: 1, 26: 1, 27: 2, 28: \'Be familiar with system programming.\', 29: \'Real life practical problems discussed in class thoroughly\'}','2020-01-06 12:54:14.982693',94),(2381,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 2, 8: 1, 9: 3, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 3, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 1, 24: 1, 25: 2, 26: 2, 27: 2, 28: \'Take it slow\', 29: \'Gives new prespective on topics\'}','2020-01-06 12:54:14.986542',94),(2382,'{0: 2, 1: 1, 2: 3, 3: 4, 4: 1, 5: 2, 6: 2, 7: 2, 8: 3, 9: 3, 10: 3, 11: 1, 12: 2, 13: 2, 14: 1, 15: 1, 16: 2, 17: 3, 18: 2, 19: 2, 20: 1, 21: 2, 22: 1, 23: 2, 24: 2, 25: 1, 26: 1, 27: 3, 28: \'Not advisable\', 29: \'No learning at all\'}','2020-01-06 12:54:14.990448',94),(2383,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 3, 18: 2, 19: 1, 20: 2, 21: 2, 22: 1, 26: 1, 27: 2, 28: \'Satisfactory i\', 29: \'interactive\'}','2020-01-06 12:54:14.994247',94),(2384,'{0: 2, 1: 1, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 2, 8: 2, 9: 3, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 2, 16: 2, 17: 3, 18: 3, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 1, 25: 1, 26: 1, 27: 4, 28: \'No comments\', 29: \'No comment\'}','2020-01-06 12:54:14.998333',94),(2385,'{0: 2, 1: 1, 2: 2, 3: 3, 4: 2, 5: 1, 6: 2, 7: 2, 8: 1, 9: 3, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 3, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1, 26: 1, 27: 3, 28: \'Come prepared! :)\', 29: \'Sir focused more on practical approach rather than mugging up concepts.\'}','2020-01-06 12:54:15.002733',94),(2386,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 2, 7: 1, 8: 2, 9: 3, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1, 26: 1, 27: 2, 28: \'Can take this course. Very important as its assignments and project increase the learning very much\', 29: \'Discussions in class\'}','2020-01-06 12:54:15.007316',94),(2387,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1, 26: 2, 27: 3, 28: \'Make sure to go through all the reading tasks given during lectures in addition to assignments. \', 29: \'The instructor gave quite a few pointers during the course to promote self learning instead of delivering one way lectures. \\r\\nInstead of adding reading tasks as an add-on over assignments, if we could get them as part of assignments, it could help students in finding time for all things. \'}','2020-01-06 12:54:15.011598',94),(2388,'{0: 2, 1: 1, 2: 3, 3: 4, 4: 3, 6: 2, 7: 2, 8: 2, 9: 3, 10: 3, 11: 2, 12: 1, 13: 2, 14: 1, 15: 2, 16: 2, 17: 4, 18: 3, 19: 3, 20: 1, 21: 2, 22: 1, 23: 2, 24: 2, 25: 1, 26: 1, 27: 4, 28: \"The subject is coding intensive with alot of assignments (heavy) and everything required self learning. Prof will hardly teach anything.  Take this subject only if you are very much interested in OS. There is no link between what is dicussed in class and what is expected of us. Hardly any new topic was discussed in depth by prof himself. Overall it wasn\'t an pleasant experience.\", 29: \"Should teach more. Cover more topics. Sometimes it\'s also important to teach few things from scratch rather than discussing considering the person knows everything\"}','2020-01-06 12:54:15.044900',94),(2389,'{0: 1, 1: 1, 2: 1, 3: 3, 4: 3, 5: 1, 6: 1, 7: 1, 8: 3, 9: 3, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 3, 18: 3, 19: 3, 20: 2, 21: 2, 22: 1, 23: 1, 24: 2, 25: 2, 26: 1, 27: 5, 28: \'Please try to give marks distribution of exam questions before the student write the answer in the exam hall\', 29: \'Introduce new topics and technologies like android and others. .  Rather than the same old btech stuffs\'}','2020-01-06 12:54:15.049555',94),(2390,'{0: 1, 1: 1, 2: 3, 3: 3, 4: 3, 5: 2, 6: 2, 7: 2, 8: 3, 9: 3, 10: 3, 11: 2, 12: 2, 13: 3, 14: 1, 15: 2, 16: 3, 17: 4, 18: 3, 19: 3, 20: 1, 21: 2, 22: 1, 23: 3, 24: 1, 25: 2, 26: 1, 27: 5, 28: \'dont take it, u will learn only stories\', 29: \'only stories\\r\\nno subject \\r\\n\'}','2020-01-06 12:54:15.053438',94),(2391,'{0: 1, 1: 1, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 2, 8: 2, 9: 3, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 3, 19: 1, 20: 2, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1, 26: 1, 27: 3, 28: \'It is a good subject, evry cs aspirant should know about baisc of os. \', 29: \'It would be best if we stay on topics that are related to os, rather than doing something that is very unrelated.\\r\\n\'}','2020-01-06 12:54:15.057654',94),(2392,'{0: 1, 1: 2, 2: 3, 3: 3, 4: 3, 5: 1, 6: 1, 7: 2, 8: 2, 9: 3, 10: 2, 11: 1, 12: 2, 13: 1, 14: 2, 15: 1, 16: 1, 17: 4, 18: 3, 19: 1, 20: 2, 21: 2, 22: 2, 23: 1, 24: 1, 25: 1, 26: 1, 27: 4, 28: \'Focus on learning. Exam will be totally unexpected in the sense that nothing from books will help. Only class discussions were effective.\', 29: \"1. No spoon-feeding lessons, which encouraged students to learn concepts themselves by hand. \\r\\n2. Gained a lot of systems knowledge.\\r\\n\\r\\n1. Don\'t allow students to present PPT from Galvin. We already know it well.\\r\\n\"}','2020-01-06 12:54:15.062165',94),(2393,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 1, 5: 1, 6: 1, 7: 2, 8: 2, 9: 2, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 3, 19: 1, 20: 2, 21: 2, 22: 1, 23: 1, 24: 2, 25: 1, 26: 1, 27: 2, 28: \'Focus more on your concepts. This course is full of concepts.\', 29: \'Sir, please you teach in class rather than telling the students to teach. Sometimes the remaining students misunderstand the concepts taught by the bus master (student)\'}','2020-01-06 12:54:15.066324',94),(2394,'{0: 2, 1: 2, 2: 1, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 1, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 1, 18: 3, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 1, 25: 2, 26: 1, 27: 3, 28: \'If you interested in system course definitely you will learn alot but if not you will struggle.\', 29: \'Sir is very interactive\'}','2020-01-06 12:54:15.070608',94),(2395,'{0: 2, 1: 1, 2: 3, 3: 3, 4: 2, 5: 1, 6: 2, 7: 2, 8: 2, 9: 3, 10: 3, 11: 2, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 4, 18: 2, 19: 2, 20: 1, 21: 2, 22: 2, 23: 2, 24: 1, 25: 1, 26: 1, 27: 3, 28: \'Be prepared to learn by yourself \', 29: \'Nothing \'}','2020-01-06 12:54:15.074467',94),(2396,'{0: 2, 1: 1, 2: 3, 3: 4, 4: 1, 5: 2, 6: 2, 7: 2, 8: 2, 9: 3, 10: 3, 11: 1, 12: 2, 13: 3, 14: 1, 15: 2, 16: 3, 17: 4, 18: 2, 19: 2, 20: 1, 21: 2, 22: 1, 23: 3, 24: 2, 25: 2, 26: 1, 27: 4, 28: \'Come with some basic learning \', 29: \'Just prepare and come in the class try to teach yourself please\'}','2020-01-06 12:54:15.078654',94),(2397,'{0: 1, 1: 2, 2: 2, 3: 3, 4: 3, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 5, 18: 2, 19: 1, 20: 1, 21: 3, 22: 1, 23: 1, 24: 1, 25: 1, 26: 1, 27: 4, 28: \'Have a good concept of os before taking this course\', 29: \'Reading assignment\'}','2020-01-06 12:54:15.084118',94),(2398,'{0: 1, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 3, 11: 1, 12: 2, 13: 2, 14: 1, 15: 1, 17: 4, 18: 3, 19: 2, 20: 1, 21: 2, 22: 3, 23: 3, 24: 2, 25: 1, 26: 2, 27: 4, 28: \'I think teaching the subject would have been better .\', 29: \'Assignments given are totally different from what is taught in class\'}','2020-01-06 12:54:15.088428',94),(2399,'{0: 1, 1: 1, 2: 3, 3: 5, 4: 2, 5: 2, 6: 2, 7: 2, 8: 3, 9: 3, 10: 3, 11: 2, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 4, 18: 2, 19: 1, 20: 1, 21: 2, 22: 1, 23: 2, 24: 1, 25: 1, 26: 2, 27: 5, 28: \'You have to do most of the work by yourself. There is no learning . Mostly it is kind of revision. \', 29: \'Most of the time I was scared about my grades , as frequently we have received those emails which mentioned that if we not do this we will be failed. I think with a free mind I can learn more. Not with this constant grade fear reminders\'}','2020-01-06 12:54:15.092797',94),(2400,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 3, 19: 2, 20: 2, 21: 2, 22: 2, 23: 1, 24: 1, 25: 1, 26: 1, 27: 2, 28: \'Learn C++\', 29: \'Things could have been more easier if recorded videos of theory and assignment tips are provided. This my thought certainly not a negative point.\'}','2020-01-06 12:54:15.096977',94),(2401,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 2, 24: 1, 25: 1, 26: 1, 27: 2, 28: \'Get clear with system programming. . Read unix operating systems book so that it is helpfull in assignments\', 29: \'He will indulge you in discussions and clear concepts and will give reading assignments which increases understanding in subject. \'}','2020-01-06 12:54:15.101007',94),(2402,'{0: 2, 1: 1, 2: 2, 3: 3, 4: 2, 5: 2, 6: 1, 7: 2, 8: 2, 9: 3, 10: 3, 11: 2, 12: 2, 13: 2, 14: 2, 15: 2, 16: 1, 17: 4, 18: 2, 19: 2, 20: 1, 21: 2, 22: 2, 23: 2, 24: 1, 25: 2, 26: 1, 27: 4, 28: \'There are learning oppurtunities but a lot of self learning is required.\', 29: \'Discussed about some of the industry benchmarks which were helpful but most of the time discussions were made on topics not of much use.\'}','2020-01-06 12:54:15.111535',94),(2403,'{0: 1, 1: 1, 2: 2, 3: 5, 4: 2, 5: 2, 6: 2, 7: 2, 8: 2, 9: 3, 10: 3, 11: 2, 12: 2, 13: 1, 14: 2, 15: 1, 16: 2, 17: 5, 18: 2, 19: 2, 20: 1, 21: 2, 22: 1, 23: 2, 24: 1, 25: 2, 26: 1, 27: 4, 28: \'Get ready for learning OS yourself. \\r\\nExpect heavy assignments.\\r\\nTheory will not be covered in class.\\r\\nAssignments are the only place where some learning happens.\', 29: \'Cover the topics in a systematic way instead of leaving it for the students to learn themselves.\\r\\nMost students used low quality sources to learn and get by (even score high) in the course.\\r\\nThe graded stuff is too much to leave time for ungraded activities. It is better to make everything graded\\r\\nThe assignments and projects in the course were really helpful in learning. I feel confident in systems programming just because of the assignment.\\r\\nPresentations by students in lieu of quiz/mid sem exam is wastage of time. Most of the times students cannot go to the expected level of detail in the topics covered. \'}','2020-01-06 12:54:15.116858',94),(2404,'{0: 1, 1: 1, 2: 2, 3: 3, 4: 2, 5: 1, 6: 2, 7: 2, 8: 2, 9: 3, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 3, 18: 2, 19: 1, 20: 1, 21: 2, 22: 1, 23: 1, 24: 1, 25: 2, 26: 1, 27: 3, 28: \'The course is a pre-requisite for other systems courses and hence is a must. The assignments given in the course are challenging and help gain practical knowledge about systems.\', 29: \'The course plan could be more structured. The content covered in class does not much help for doing assignments. Hence both the class content and the assignments could have been more aligned.\\r\\nAlso the course grading system was allowed to be flexible but students are unaware of the course difficulty and hence are unable to decide grading system for the course on themselves. Hence keeping the grading system open was not helpful for students.\'}','2020-01-06 12:54:15.120825',94),(2405,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 2, 5: 1, 6: 2, 7: 1, 8: 2, 9: 2, 10: 3, 11: 1, 12: 1, 13: 2, 14: 2, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 1, 25: 1, 26: 2, 27: 2, 28: \'Good luck\', 29: \'Motivational talk and outer knowledge\'}','2020-01-06 12:54:15.124986',94),(2406,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 1, 9: 1, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 2, 25: 1, 26: 2, 27: 1, 28: \'-\', 29: \'-\'}','2020-01-06 12:54:15.128868',137),(2407,'{0: 3, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 3, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 3, 28: \'The course has a lot of content and is a little hectic\', 29: \'The scope of the course is too wide to be covered in 26 lectures. In my opinion the course should have lesser modules.\'}','2020-01-06 12:54:15.132535',137),(2408,'{0: 3, 1: 3, 2: 2, 3: 5, 4: 3, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 3, 19: 1, 20: 2, 21: 2, 22: 1, 23: 1, 24: 2, 25: 1, 26: 2, 27: 2, 28: \"Don\'t take this course if you are seeking grades.\\r\\nTake only if you seek knowledge.\", 29: \'Responsive to queries\'}','2020-01-06 12:54:15.136221',137),(2409,'{0: 3, 1: 2, 2: 2, 3: 2, 4: 2, 5: 2, 6: 1, 7: 2, 8: 2, 9: 2, 10: 1, 11: 1, 12: