s rather than come and write on the board \', 29: \'should write less and explain more \'}','2020-01-06 12:54:16.589185',130),(2660,'{0: 1, 1: 2, 2: 2, 3: 4, 4: 1, 5: 1, 6: 1, 7: 2, 8: 2, 9: 2, 10: 2, 11: 1, 12: 1, 13: 3, 14: 1, 15: 1, 16: 2, 17: 3, 18: 2, 19: 2, 20: 1, 21: 1, 22: 2, 23: 2, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'Good subject to enhance your thinking skills and help you in C pro.\', 29: \'Should teach each and every thing calmly and move on to another topic once it is fully cleared.Make the class more interesting by asking questions or taking more examples.\\r\\n\'}','2020-01-06 12:54:16.594407',130),(2661,'{0: 1, 1: 1, 2: 3, 3: 4, 4: 2, 5: 2, 6: 2, 7: 2, 8: 3, 9: 2, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 3, 18: 1, 19: 2, 20: 2, 21: 2, 22: 3, 23: 1, 24: 3, 25: 2, 26: 2, 27: 2, 28: \"It is a very important course regarding future aspects. Please don\'t rely on Prof for it.\", 29: \'Nothing.\'}','2020-01-06 12:54:16.599549',130),(2662,'{0: 2, 1: 3, 2: 2, 3: 3, 4: 1, 5: 1, 6: 2, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 2, 24: 3, 25: 1, 26: 1, 27: 2, 28: \'Useful but know some basics clearly\', 29: \'Doing proofs in a understandable way..\'}','2020-01-06 12:54:16.619396',130),(2663,'{0: 2, 1: 2, 2: 1, 3: 3, 4: 1, 5: 1, 6: 2, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 3, 22: 2, 23: 2, 24: 3, 25: 1, 26: 1, 27: 2, 28: \'Good logical course.\', 29: \'Nothing sir.\'}','2020-01-06 12:54:16.632480',130),(2664,'{0: 1, 1: 1, 2: 3, 3: 5, 4: 3, 5: 2, 6: 2, 7: 2, 8: 3, 9: 3, 10: 1, 11: 2, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 4, 18: 2, 19: 3, 20: 1, 21: 2, 22: 3, 23: 3, 24: 3, 25: 1, 26: 2, 27: 5, 28: \'Not to depend on instructor\', 29: \'Make the teaching slower and not as id to complete the syllabus\'}','2020-01-06 12:54:16.637615',130),(2665,'{0: 3, 1: 3, 2: 1, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 2, 13: 1, 14: 1, 15: 1, 16: 3, 17: 2, 18: 3, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 3, 25: 1, 26: 1, 27: 2, 28: \'good\', 29: \'good\'}','2020-01-06 12:54:16.641803',130),(2666,'{0: 2, 1: 2, 2: 2, 3: 5, 4: 2, 5: 2, 6: 1, 7: 1, 8: 2, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 3, 19: 1, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 1, 28: \'I took this course because I love algorithms. But, I was not able to connect to it. The course is tough, It involves proofs. I would advice you to not fear like I did. I would advice you to ask sir what he will teach in class and study(very rigorously) what is to be taught before the class. The class has a fast pace. Many students are very quick learner and catch everything sir says. tO COPE UP WITH IT, YOU NEED TO STUDY BEFORE GOING TO CLASS. This is the mistake I did. The randomization part needs probability. So, If you are weak in it, before taking this course, get stronger in probability. Take nptel/mit lectures before taking this course. Before taking this course, Study the space complexity part of sipser. Prepare yourself because if you are bit slow learner, you will face a lot of problems. I did that mistake.\\r\\nThis is a beautiful course. Everybody is capable. You are capable too. Just a bit of push, a bit of hardwork. And you will match the level of class.\', 29: \'Sir discusses the problems very nicely with the students. He does not discriminates between students. He is very easy to approach and has a positive vibe nature. He is no doubt, one of the most knowledgeable faculty and is very helping to students. I just wish, he is bit slow to students who are bit slow learner, but I guess that is not possible because rest of the class is very fast learner. A beautiful course but a kind professor.\'}','2020-01-06 12:54:16.645575',79),(2667,'{0: 2, 1: 2, 2: 2, 3: 5, 4: 2, 5: 2, 6: 1, 7: 1, 8: 2, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 3, 19: 1, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 1, 28: \'I took this course because I love algorithms. But, I was not able to connect to it. The course is tough, It involves proofs. I would advice you to not fear like I did. I would advice you to ask sir what he will teach in class and study(very rigorously) what is to be taught before the class. The class has a fast pace. Many students are very quick learner and catch everything sir says. tO COPE UP WITH IT, YOU NEED TO STUDY BEFORE GOING TO CLASS. This is the mistake I did. The randomization part needs probability. So, If you are weak in it, before taking this course, get stronger in probability. Take nptel/mit lectures before taking this course. Before taking this course, Study the space complexity part of sipser. Prepare yourself because if you are bit slow learner, you will face a lot of problems. I did that mistake.\\r\\nThis is a beautiful course. Everybody is capable. You are capable too. Just a bit of push, a bit of hardwork. And you will match the level of class.\', 29: \'Sir discusses the problems very nicely with the students. He does not discriminates between students. He is very easy to approach and has a positive vibe nature. He is no doubt, one of the most knowledgeable faculty and is very helping to students. I just wish, he is bit slow to students who are bit slow learner, but I guess that is not possible because rest of the class is very fast learner. A beautiful course but a kind professor.\'}','2020-01-06 12:54:16.655881',79),(2668,'{0: 3, 1: 2, 2: 2, 3: 3, 4: 1, 5: 2, 6: 1, 7: 1, 8: 2, 9: 3, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 3, 20: 2, 21: 3, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'Many hard topics like Group Theory, Number Theory were covered in just a few classes although understanding the deep impact of it takes much longer time than given. The scope of the course is enormous so one should spent a lot of time on his/her own to fully understand and practice whatever has been taught in class. Such important topics have been taught in a gist while when you practice, the gist is way too insufficient to even begin and the whole content has to be relearned in a self-adjusted pace.\', 29: \"The Prof listed all the resources way before the topic was covered so we could use them accordingly (didn\'t have to wait). Prof was also responsive to our queries and good thing was he posted lot of tutorial sheets which helped in refining my understanding of the topics. But the content/scope of the course was way too large which resulted in the Prof rushing through topics to cover the syllabus and we not having enough to time to understand the preceeding topic while the next topic got over.\"}','2020-01-06 12:54:16.661823',130),(2669,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 1, 5: 1, 6: 2, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 2, 16: 1, 17: 2, 18: 3, 19: 2, 20: 2, 21: 2, 22: 1, 23: 2, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'Subject helps to build logic at some intuitive level. Try to maintain the pace.\', 29: \'Explanations are sometimes little bit confusing that needs to be improved.\'}','2020-01-06 12:54:16.666217',130),(2670,'{0: 1, 1: 1, 2: 1, 3: 3, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 1, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 1, 19: 2, 20: 2, 21: 1, 22: 3, 23: 1, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'The course may seem boring initially but becomes interesting later it is just that some of the good part you will have to study on your own because it is skipped in classes due to time constraints or it is not part of the syllabus.\', 29: \'The availability of eBooks and materials along with tutorial sheets on Moodle helped a lot along with the well structured syllabus. We were not able to cover all the parts of the syllabus and had to skip a few topics. It would be better had these topics not been skipped. I would also like to have more difficult questions in the classes, assignments and tutorial sheets.\'}','2020-01-06 12:54:16.670550',130),(2671,'{0: 1, 1: 2, 2: 3, 3: 4, 4: 3, 5: 2, 6: 2, 7: 2, 8: 3, 9: 3, 10: 1, 11: 2, 12: 2, 13: 3, 14: 1, 15: 3, 16: 1, 17: 4, 18: 3, 19: 1, 20: 3, 21: 3, 22: 3, 23: 3, 24: 2, 25: 1, 26: 1, 27: 5, 28: \'Nothing \', 29: \'Give feelings of course\'}','2020-01-06 12:54:16.675135',130),(2672,'{0: 2, 1: 2, 2: 3, 3: 3, 4: 2, 5: 1, 6: 2, 7: 2, 8: 2, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 3, 18: 3, 19: 3, 20: 3, 21: 2, 22: 3, 23: 3, 24: 1, 25: 1, 26: 2, 27: 4, 28: \'Take only iff interested\', 29: \'Structure of course can be improved..\'}','2020-01-06 12:54:16.679998',71),(2673,'{0: 2, 1: 2, 2: 3, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 1, 11: 2, 12: 2, 13: 2, 14: 3, 15: 2, 16: 2, 17: 2, 18: 2, 19: 1, 20: 2, 21: 2, 22: 2, 23: 1, 24: 1, 25: 1, 26: 1, 27: 2, 28: \'Na\', 29: \'Na\'}','2020-01-06 12:54:16.684895',71),(2674,'{0: 1, 1: 1, 2: 3, 3: 5, 4: 3, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 2, 16: 2, 17: 2, 18: 3, 19: 2, 20: 2, 21: 1, 22: 2, 23: 2, 24: 1, 25: 1, 26: 2, 27: 4, 28: \'Need to have background of civil engineering\', 29: \'More knowledge should be given for computer modelling\'}','2020-01-06 12:54:16.689621',71),(2675,'{0: 2, 1: 2, 2: 2, 3: 5, 4: 3, 5: 2, 6: 2, 7: 1, 8: 3, 9: 3, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 3, 18: 3, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 3, 25: 1, 26: 2, 27: 3, 28: \'The course is a good subject as it is required for Computer Science. Keep in mind that the classes would be boring and you might have to do a lot of work on your own to do the assignments.\', 29: \"Please make the classes more interesting and don\'t read out from the slides. Give us all the material you are explaining from and explain the parts that actually need explaining. If it\'s just reading out the slides, we can do it on our own too.\"}','2020-01-06 12:54:16.697430',130),(2676,'{0: 2, 1: 2, 2: 3, 3: 4, 4: 3, 5: 1, 6: 1, 7: 1, 8: 3, 9: 3, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 4, 18: 3, 1