: 2, 1: 2, 2: 1, 3: 3, 4: 2, 5: 1, 6: 2, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 2, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 2, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'Attending all the class will be good\', 29: \'maybe he uses slides instead of writing everything on board so that there will be time left and he can say some problems\'}','2020-01-06 12:54:16.760360',130),(2690,'{0: 2, 1: 2, 2: 2, 3: 4, 4: 3, 5: 2, 6: 2, 7: 1, 8: 3, 9: 3, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 2, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 3, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 3, 28: \'Requires understanding \', 29: \'Try to make class interesting\'}','2020-01-06 12:54:16.765563',130),(2691,'{0: 2, 1: 2, 2: 3, 3: 3, 4: 2, 5: 1, 6: 1, 7: 2, 8: 2, 9: 2, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 2, 16: 1, 17: 3, 18: 2, 19: 2, 20: 2, 21: 3, 22: 1, 23: 2, 24: 3, 25: 1, 26: 2, 27: 3, 28: \'Self study would be better than listening to the classes so always rely on oneself\', 29: \'Not so effective,self study helped me more\'}','2020-01-06 12:54:16.770038',130),(2692,'{0: 1, 1: 2, 2: 2, 3: 3, 4: 1, 5: 2, 6: 2, 7: 2, 8: 2, 9: 3, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 2, 16: 1, 17: 2, 18: 2, 19: 2, 20: 1, 21: 2, 22: 2, 23: 1, 24: 3, 25: 1, 26: 2, 27: 3, 28: \'Be ready to self learn some things.\', 29: \'Sir, the time division for topics made it very hard for us to cope up. Tougher topics like group theory and graph theory should have been given much more time. These are tremendously important topics and deserve more time to sink in the minds of students.\'}','2020-01-06 12:54:16.774838',130),(2693,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'Solve tutorial questions. It helps.\', 29: \'It would be more helpful if less time was spent on basic topics like logic and set theory and more time was given to graph theory.\'}','2020-01-06 12:54:16.788028',130),(2694,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 1, 18: 3, 19: 2, 20: 2, 21: 2, 22: 1, 23: 2, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'-\', 29: \'Uploaded materials and PDFs on Moodle were extremely helpful.\'}','2020-01-06 12:54:16.792453',130),(2695,'{0: 2, 1: 2, 2: 2, 3: 4, 4: 3, 5: 2, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 2, 16: 1, 17: 2, 18: 3, 19: 3, 20: 2, 21: 3, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'Remember to pay attention in class or you will miss out on a lot\', 29: \'Most concepts were explained clearly.Doubt clearing could be better\'}','2020-01-06 12:54:16.798124',130),(2696,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 1, 22: 3, 23: 1, 24: 3, 25: 1, 26: 2, 27: 1, 28: \'To give proper attention to the class and learn the application of whatever is taught. The basics of this course is extremely important for coding later on\', 29: \'He adjusts his pace very well and answers all the doubts of students without hurry. He discusses the question on hand with everyone. A suggestion would be to discuss more about the application of concepts and do more sums while in the class\'}','2020-01-06 12:54:16.802101',130),(2697,'{0: 2, 1: 2, 2: 1, 3: 1, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 1, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 1, 28: \'Nothing\', 29: \'Any unimportant is not discussed during class.\'}','2020-01-06 12:54:16.806088',130),(2698,'{0: 2, 1: 2, 2: 1, 3: 1, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 1, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1, 26: 2, 27: 1, 28: \"Take it don\'t hate it\", 29: \'He is calm and explains doubts really well\\r\\n\'}','2020-01-06 12:54:16.809980',130),(2699,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 1, 5: 1, 6: 2, 7: 2, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 2, 18: 3, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 3, 25: 2, 26: 2, 27: 1, 28: \'Nice course. Well explained.\', 29: \"Kept the interested in topic mostly\\r\\nWant more problems in class, harder problems in tuts\\r\\nAlso don\'t give same exam probs as the ones done in tut\"}','2020-01-06 12:54:16.814966',130),(2700,'{0: 2, 1: 2, 2: 3, 3: 4, 4: 2, 5: 2, 6: 2, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 3, 18: 2, 19: 1, 20: 2, 21: 1, 22: 3, 23: 3, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'Read through the topics before it is discussed in class.\', 29: \'The instructor should pay more attention to the students.\'}','2020-01-06 12:54:16.818907',130),(2701,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 1, 5: 1, 6: 2, 7: 2, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 1, 18: 3, 19: 3, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 2, 26: 2, 27: 1, 28: \'Practice a lot\', 29: \'Multiple resources were given on moodle and they were very useful \'}','2020-01-06 12:54:16.822884',130),(2702,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 1, 5: 1, 6: 2, 7: 1, 8: 2, 9: 1, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 1, 28: \"The topics in themselves are very interesting. They require a lot if practice, which includes solving questions apart from what is taught in the class. Sometimes things might not be clear in a lecture, it\'s in best interest to get the doubt cleared as soon as possible (with the help or someone or even without) because that doubt builds upon as the course progresses.\", 29: \'Open discussion and solutions to doubts are the best point of the course instructor. The explanation might not have been too good at times, but was satisfactory enough to understand the course, if not ignite proper interest. Resources provided are brilliant and very much insoire the student to look into the beautiful intricacies of the subject.\'}','2020-01-06 12:54:16.827061',130),(2703,'{0: 2, 1: 2, 2: 2, 3: 4, 4: 3, 5: 1, 6: 2, 7: 1, 8: 3, 9: 3, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 2, 18: 3, 19: 2, 20: 2, 21: 3, 22: 1, 23: 2, 24: 3, 25: 1, 26: 2, 27: 3, 28: \"The TAs are not of much help in this course. Sometimes, they can\'t communicate effectively at all and leave the students confused. Tutorials are never used to the utmost potential. The Tas just come for the sake of coming. \\r\\nThe professor tries his best, but sometimes some topics are covered way too quickly and sometimes it includes important topics as well. \\r\\nThe level of assignments and exams are far above the level of questions discussed in class. \", 29: \'He always answers doubts and is very helpful when it comes to queries. He genuinely listens to us. \'}','2020-01-06 12:54:16.831521',130),(2704,'{0: 1, 1: 2, 2: 1, 3: 3, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 3, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 3, 19: 2, 20: 2, 21: 2, 22: 1, 23: 2, 24: 3, 25: 1, 26: 1, 27: 2, 28: \'just be awake in class and study the material suggested by the proffesor\', 29: \'having a little fun while studying helped me learn better\'}','2020-01-06 12:54:16.836457',130),(2705,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 3, 19: 3, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 2, 26: 2, 27: 2, 28: \'Will be interesting\', 29: \'Devoted \'}','2020-01-06 12:54:16.841337',130),(2706,'{0: 2, 1: 2, 2: 1, 3: 3, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 2, 15: 1, 16: 1, 17: 2, 18: 2, 19: 1, 20: 2, 21: 2, 22: 2, 23: 1, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'Keep solving textbook questions\', 29: \'His knowledge is great\'}','2020-01-06 12:54:16.846070',130),(2707,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 2, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 3, 23: 2, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'Take the course . It is very interesting.\', 29: \'Instructor is approachable and always gives time for discussion which helped me to understand the topic better\'}','2020-01-06 12:54:16.851185',130),(2708,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 1, 25: 1, 26: 1, 27: 2, 28: \'Study daily topics\', 29: \'Wants us to improve by ourselves a lot\'}','2020-01-06 12:54:16.855851',130),(2709,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 1, 5: 1, 6: 2, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 2, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 3, 25: 1, 26: 2, 27: 2, 28: \"They should take it as it\'s helpful in cp \", 29: \'The pace at which he teaches is good\'}','2020-01-06 12:54:16.860352',130),(2710,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'Revise topics daily\', 29: \'Knew subject well\'}','2020-01-06 12:54:16.864434',130),(2711,'{0: 3, 1: 2, 2: 2, 3: 4, 4: 1, 5: 1, 6: 2, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 1, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'Keep reviseing the topics taught as this is very important. \', 29: \'The source material provided on moodle was very effective in grasping the concepts more thoroughly \'}','2020-01-06 12:54:16.868178',130),(2712,'{0: 2, 1: 1, 2: 2, 3: 4, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 1, 22: 2, 23: 2, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'You will have to interact with sir in class to understand.  Ask doubts and participate in discussions. \', 29: \'The instructor could be more prepared before coming to class. Sometimes there are better solutions to problems than the solutions mentioned in class. \'}','2020-01-06 12:54:16.872008',130),(2713,'{0: 2, 1: 2, 2: 1, 3: 1, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 3, 20: 2, 21: 1, 22: 1, 23: 2, 24: 3, 25: 2, 26: 2, 27: 1, 28: \'Pay attention to class\', 29: \'Elaborate explanations \'}','2020-01-06 12:54:16.875986',130),(2714,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 2, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 3, 23: 2, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'This is not an elective course\\r\\nImportant course\', 29: \'   \'}','2020-01-06 12:54:16.879910',130),(2715,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 2, 16: 2, 17: 2, 18: 2, 19: 1, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 2, 26: 2, 27: 2, 28: \'This course is important to CS.  Take the course and keep an open imagination to visualise abstract things.\', 29: \'Sir listens to our doubts and clears them well. Sir also teaches good but sometimes things get monotonous. Maybe a few real world applications would help cause when things get too abstract we start losing interest.\'}','2020-01-06 12:54:16.885351',130),(2716,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 1, 5: 1, 6: 2, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 1, 20: 2, 21: 2, 22: 3, 23: 2, 24: 3, 25: 1, 26: 2, 27: 1, 28: \'Take this course as its helpful in thinking about problems and solving them\', 29: \'He discusses every problem with the students and gives proper time for topics. He is also very patient while teaching. \'}','2020-01-06 12:54:16.889813',130),(2717,'{0: 2, 1: 2, 2: 3, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 2, 11: 1, 12: 2, 13: 2, 14: 1, 15: 1, 16: 1, 17: 3, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'Self learning will be your biggest friend in rescue. \', 29: \'1.The instructor did lot of proofs which helped a lot.\\r\\n2.It would be better if we are not taught just what and as stated in the books\'}','2020-01-06 12:54:16.894025',130),(2718,'{0: 2, 1: 2, 2: 1, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 2, 24: 3, 25: 2, 26: 2, 27: 2, 28: \'Overall a good course with a lot of practical components required in CS.\', 29: \'Teaches really well.\'}','2020-01-06 12:54:16.898253',130),(2719,'{0: 1, 1: 2, 2: 2, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 1, 20: 2, 21: 1, 22: 1, 23: 1, 24: 1, 25: 1, 26: 1, 27: 2, 28: \'Be prepared to spend enough time outside of the class to understand the topics more deeply\', 29: \"It is easier to cope up with the class when there are PPTs because he doesn\'t have to rub off the board and we have more time to comprehend\"}','2020-01-06 12:54:16.902367',130),(2720,'{0: 2, 1: 2, 2: 1, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 1, 20: 2, 21: 2, 22: 2, 23: 2, 24: 3, 25: 2, 26: 2, 27: 2, 28: \'This course is extremely useful for future purposes such as competitive coding. It is a good course to take.\', 29: \'Sir was extremely patient and explained our doubts regardless of how small they were. He made sure we learnt our mistakes by asking us to re-solve them in tutorials. The tutorials set by him are of extreme use.\'}','2020-01-06 12:54:16.906782',130),(2721,'{0: 2, 1: 2, 2: 1, 3: 3, 4: 3, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 1, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 2, 28: \"It\'s nice course to take as it requires logical thinking.\", 29: \"The professor provided good notes in the class and clearly specified the resources from where to study,so that we didn\'t have to dive into so many resources to find a good one. This saved a lot of time of ours.\"}','2020-01-06 12:5