, 29: \'.\'}','2020-01-06 12:54:17.098895',99),(2753,'{0: 3, 1: 2, 2: 2, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 1, 25: 1, 26: 1, 27: 2, 28: \'It is a good course one can take over.\', 29: \'Sometimes the Prof was faster and that time it was difficult to cop up with. The proofs need be explained in a more detailed manner and slowly.\'}','2020-01-06 12:54:17.103245',99),(2754,'{0: 3, 1: 2, 2: 2, 3: 3, 4: 2, 5: 2, 6: 2, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 3, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 1, 24: 1, 25: 1, 26: 1, 27: 2, 28: \'You would need to learn the things in parallel as the course requires serious commitment to the material covered in it. \', 29: \'The instructor could have been a little bit slow on the relatively difficult topics and spent more time over there and could have reduced time spent on relatively simpler topics. \'}','2020-01-06 12:54:17.112445',99),(2755,'{0: 3, 1: 2, 2: 2, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 3, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 1, 25: 1, 26: 1, 27: 2, 28: \'Explore the topics as much u can\', 29: \'Speed of covering topics is needed to be slowed a bit\'}','2020-01-06 12:54:17.116737',99),(2756,'{1: 2, 4: 2, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 14: 1, 17: 1, 19: 1, 20: 2, 26: 2, 28: \'.\', 29: \'.\'}','2020-01-06 12:54:17.121245',99),(2757,'{0: 3, 1: 2, 2: 2, 3: 2, 4: 1, 5: 2, 6: 2, 7: 1, 8: 2, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 3, 19: 1, 20: 2, 21: 3, 22: 1, 23: 1, 24: 1, 25: 1, 26: 1, 27: 1, 28: \"It\'s a very interesting course. It really improve your thinking skills and way of problem solving.\", 29: \'Course content was very good.\\r\\nEach topic should be covered with more practical examples and the easiest way possible.\'}','2020-01-06 12:54:17.125326',99),(2758,'{0: 3, 1: 2, 2: 2, 3: 4, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 3, 22: 2, 23: 1, 24: 1, 25: 1, 26: 1, 27: 3, 28: \'Make sure your basics are clear.\', 29: \'* Explaination of some topics could be more easy and clear.\'}','2020-01-06 12:54:17.129714',99),(2759,'{0: 2, 1: 2, 2: 2, 3: 4, 4: 2, 5: 1, 6: 2, 7: 2, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 24: 1, 25: 1, 26: 1, 27: 2, 28: \'Give your 100% to this course its benificial in all aspects\', 29: \'Instructor was very good in teaching but speed is too fast.. we were unable to note down things , due to which suffecient material lacked during exams adcersely affecting our performances. On request of providing slides, the request was denied on an account tgat students themselves will learn but that lead to a negative thing of not getting concepts clear\'}','2020-01-06 12:54:17.133898',99),(2760,'{0: 3, 1: 2, 2: 3, 3: 4, 4: 2, 5: 2, 6: 2, 7: 1, 8: 1, 9: 2, 10: 2, 11: 2, 12: 1, 13: 1, 14: 1, 15: 1, 16: 3, 17: 3, 18: 2, 19: 2, 20: 1, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1, 26: 1, 27: 2, 28: \'The course is very comprehensive, not all details can be covered in the limited time we have. Expect to learn 90 percent of the things by yourself\', 29: \'The amount of content that the course aims to cover is well beyond what is possible in 2 hour lectures.\\r\\nConsider limiting the topics covered, while increasing the focus given to each topic.\\r\\nThere were only 1-2 classes in this course where I understood everything covered. \\r\\nHard topics and derivations were glossed over, while lot of time was spent on easy things.\\r\\nMotivation for the topics covered was very well done\'}','2020-01-06 12:54:17.138296',99),(2761,'{0: 3, 1: 3, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 1, 20: 2, 21: 3, 22: 2, 23: 1, 24: 1, 25: 1, 26: 1, 27: 3, 28: \'Study things along with the teaching as the course content is huge\', 29: \'The topics cobered were good, but my perception of thia course was to learn and be able to develop logic and thinking.  It sufficed learnibg but logic and thinking may be not.  So probably cover less content but explore all possibilities of that particular topic.  \'}','2020-01-06 12:54:17.142462',99),(2762,'{0: 3, 1: 3, 2: 3, 3: 3, 4: 2, 5: 2, 6: 2, 7: 1, 8: 2, 9: 2, 10: 1, 11: 2, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 1, 21: 2, 22: 1, 23: 1, 24: 1, 25: 2, 26: 1, 27: 3, 28: \'Try to cover more time in difficult topics rather than taking whole class on easier topics\', 29: \'Good assignments and projects\'}','2020-01-06 12:54:17.159912',99),(2763,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 1, 11: 2, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 3, 18: 2, 19: 2, 20: 2, 21: 2, 22: 3, 23: 3, 24: 1, 25: 1, 26: 1, 27: 1, 28: \'Focus on learning rather than going for the marks. \', 29: \'Explanation for the topics can be much better. \\r\\n\'}','2020-01-06 12:54:17.191575',99),(2764,'{0: 2, 1: 3, 2: 2, 3: 2, 4: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 24: 1, 25: 1, 26: 1, 27: 2, 28: \'There is a high chance that we think we know this course but there are various things which we learn during the course. I suggest that they should take it to improve their own understanding of algorithms.\', 29: \'The instructor motivates us to read the things taught in class again at home to get a more clear and detailed idea about it.\'}','2020-01-06 12:54:17.199562',99),(2765,'{0: 3, 1: 2, 2: 2, 3: 4, 4: 1, 5: 2, 6: 2, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 3, 18: 2, 19: 3, 20: 2, 21: 2, 22: 1, 23: 2, 24: 1, 25: 1, 26: 1, 27: 3, 28: \"It\'s good to be prepared with the basic data structures and should be able to code them.Also you should be good in competitive coding before taking this course...\", 29: \"It\'s beneficial to share the contents the slides for each topic so that we don\'t have to roam around searching in internet. It saves a lot of time for the student. Also the course can be made a little slow paced. Rather than teaching a lot of topics, fewer topics may be taught with a little more details..\"}','2020-01-06 12:54:17.203664',99),(2766,'{0: 3, 1: 2, 2: 2, 3: 2, 4: 2, 5: 2, 6: 2, 7: 1, 8: 2, 9: 1, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 3, 20: 2, 21: 2, 22: 1, 23: 3, 24: 1, 25: 2, 26: 1, 27: 3, 28: \"It\'s going to be hectic\", 29: \'Determined and passionate\'}','2020-01-06 12:54:17.207647',99),(2767,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 1, 25: 1, 26: 1, 27: 2, 28: \"Always refer books and more resources for topics and don\'t rely solely on class notes\", 29: \'He mostly discussed the approach to arrive at a solution and the reason for doing things which helped in developing better understanding\'}','2020-01-06 12:54:17.211907',99),(2768,'{0: 3, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 2, 7: 2, 8: 2, 9: 1, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 1, 24: 1, 25: 1, 26: 1, 27: 2, 28: \"Before taking this course, be well prepared with the basics of data structures as lot of the basics wouldn\'t be covered thoroughly but applications on them would be asked for solving real life problems.\", 29: \'Instructor should teach a little slow rather than covering everything. Instructor should also check on the plagiarism check of assignments and lab exams.\'}','2020-01-06 12:54:17.215902',99),(2769,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 2, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 1, 24: 1, 25: 1, 26: 1, 27: 2, 28: \'Very interesting course to take but do some practice with algorithms and coding as pre requisites \', 29: \'Proper utilization of time.\\r\\nDisciplined teaching \'}','2020-01-06 12:54:17.219826',99),(2770,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1, 26: 1, 27: 2, 28: \"It\'s an awesome course with wide range of topics. If you get a chance, do take it.\", 29: \'The way slides of the course were prepared were amazing and required us to think more logically and also there was an added research component to it. I would suggest to add more examples for certain topics which were not covered during B.Tech course.Plus pace for those topics should be little slow than usual.\'}','2020-01-06 12:54:17.223843',99),(2771,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 1, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1, 26: 1, 27: 2, 28: \'It is a good course to help you develop your ability to think of how to solve problems\', 29: \'Emphasis was placed on thinking of how to approach a problem and come up with a solution for it, rather than simply learning available solutions\'}','2020-01-06 12:54:17.228247',99),(2772,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 2, 8: 2, 9: 2, 10: 2, 11: 2, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 3, 18: 2, 19: 2, 20: 1, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1, 26: 1, 27: 3, 28: \'Some advance data structure you will learn\', 29: \'Difficult topics should be given more time and should be explained with more examples \'}','2020-01-06 12:54:17.232179',99),(2773,'{1: 2, 4: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 14: 1, 17: 2, 19: 1, 20: 2, 26: 1, 28: \'.\', 29: \'.\'}','2020-01-06 12:54:17.235993',99),(2774,'{0: 2, 1: 3, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 1, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 1, 25: 1, 26: 1, 27: 2, 28: \'No comments\', 29: \'No comments\'}