 28: \"Try to learning stuff before the class, because they won\'t teach anything in class\", 29: \'Try teaching the stuff first before telling us to learn more about it ourselves.\'}','2020-01-06 12:54:17.769985',104),(2860,'{0: 3, 1: 3, 2: 3, 3: 5, 4: 3, 5: 2, 6: 2, 7: 2, 8: 2, 9: 3, 10: 3, 11: 2, 12: 2, 13: 3, 14: 3, 15: 2, 16: 2, 17: 5, 18: 2, 19: 3, 20: 1, 21: 3, 22: 2, 23: 3, 24: 2, 25: 2, 26: 2, 27: 5, 28: \"Please don\'t do this if azeemuddin Syed is taking the course\", 29: \'Should be more involved in the process of learning, the only time I heard him speak is when he asked questions in the viva\'}','2020-01-06 12:54:17.773985',104),(2861,'{0: 2, 1: 1, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 2, 8: 2, 9: 3, 10: 3, 11: 2, 12: 1, 13: 2, 14: 1, 15: 2, 16: 1, 17: 3, 18: 2, 19: 3, 20: 2, 21: 2, 22: 2, 23: 2, 24: 1, 25: 2, 26: 2, 27: 3, 28: \'Depending on instructor choose the course.\', 29: \"The instructor has to interact with students about each experiment, though TA\'s know something.\"}','2020-01-06 12:54:17.778147',104),(2862,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 1, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 2, 24: 1, 25: 1, 26: 2, 27: 1, 28: \'Very productive and helpful in learning new and interesting stuff \', 29: \'The concepts were explained well on the board, and the problems related to the circuits were catered to and answered all the queries and doubts if the students very well.\'}','2020-01-06 12:54:17.782724',104),(2863,'{0: 1, 1: 1, 2: 2, 3: 4, 4: 2, 5: 2, 6: 2, 7: 2, 8: 2, 9: 3, 10: 3, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 3, 18: 3, 19: 2, 20: 2, 21: 3, 22: 1, 23: 2, 24: 2, 25: 2, 26: 2, 27: 3, 28: \"I will just say Don\'t take this course. Because TA\'s are very nice but prof doesn\'t take a single lecture.\", 29: \"I doesn\'t want to tell anything because I doesn\'t learn anything from this course\"}','2020-01-06 12:54:17.786780',104),(2864,'{0: 2, 1: 1, 2: 2, 3: 3, 4: 2