0: 2, 1: 1, 2: 1, 3: 3, 4: 2, 5: 1, 6: 2, 7: 1, 8: 2, 9: 2, 10: 2, 11: 2, 12: 2, 13: 2, 14: 2, 15: 2, 16: 1, 17: 3, 18: 2, 19: 1, 20: 2, 21: 2, 22: 1, 23: 2, 24: 2, 25: 2, 26: 2, 27: 2, 28: \'It is a good course and make sure to explore electronics by yourself instead of blindly following the labs.\', 29: \"1) I\'d prefer if he\'d come to class more often and teach the necessary things instead of coming only for the Viva\\r\\n2) Also I hope that the class would be more flexible and that we do more cool stuff rather than waste time on simple measuring experiments that we are already used to.\\r\\n3) the project could be mad longer if the course was made into a whole semester course because this half-semester plan is quite hard to balance the second half of the semester with such a high number of labs due to the squeezing of the course.\"}','2020-01-06 12:54:17.811180',104),(2868,'{0: 2, 1: 1, 2: 3, 3: 3, 4: 2, 5: 2, 6: 2, 7: 2, 8: 3, 9: 2, 10: 3, 11: 2, 12: 2, 13: 3, 14: 2, 15: 3, 16: 2, 17: 5, 18: 2, 19: 1, 20: 2, 21: 2, 22: 2, 23: 3, 24: 1, 25: 2, 26: 2, 27: 2, 28: \'The course content is good, but never depend on the instructer, because he is not having a good idea about course content.\\r\\nI was also interested , seeing the course content, but the lack of efficiency of doubt clearance, at many instances disappointed me.\', 29: \'Nothing effective.\\r\\nHe was not confident while clearing doubts, and the Vivas were not conducted properly.\'}','2020-01-06 12:54:17.831980',104),(2869,'{0: 2, 1: 2, 4: 3, 8: 2, 9: 3, 10: 2, 11: 1, 12: 1, 14: 2, 17: 3, 19: 1, 20: 2, 22: 1, 25: 2, 26: 2, 27: 3, 28: \'There are going to be a lot of assignments every week\', 29: \'Debugging the mistakes in our circuit\'}','2020-01-06 12:54:17.847164',104),(2870,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 3, 11: 1, 12: 1, 13: 2, 14: 1, 15: 2, 16: 2, 17: 3, 18: 2, 19: 1, 20: 2, 21: 2, 22: 2, 23: 1, 24: 1, 25: 1, 26: 2, 27: 3, 28: \'I would like to recommend this course to other students as this course is helpful in understanding the basics of electronic engineering. \', 29: \'The professor helped us in understanding the course .\'}','2020-01-06 12:54:17.851606',104),(2871,'{0: 2, 1: 3, 2: 2, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 2, 11: 1, 12: 2, 13: 2, 14: 2, 15: 1, 16: 2, 17: 3, 18: 2, 19: 3, 20: 3, 21: 2, 22: 1, 23: 2, 24: 1, 25: 1, 26: 1, 27: 2, 28: \'None\', 29: \'None\'}','2020-01-06 12:54:17.855834',104),(2872,'{0: 1, 1: 1, 2: 3, 3: 3, 4: 3, 5: 2, 6: 2, 7: 1, 8: 3, 9: 2, 10: 3, 11: 2, 12: 2, 13: 3, 14: 1, 15: 1, 16: 3, 17: 5, 18: 2, 19: 2, 20: 1, 21: 2, 22: 1, 23: 2, 24: 1, 25: 2, 26: 2, 27: 5, 28: \'I will advice him to take up this course if the faculty is quite good in explaining the topics of particular experiment. If the instructor is same as the instructor we got I personally advice him not to take up this course\', 29: \'It would be better if the instructor explains certain topics in detail. If he does so he can expect the answers which he questions us in viva.\'}','2020-01-06 12:54:17.860031',104),(2873,'{0: 3, 1: 1, 2: 3, 3: 4, 4: 3, 5: 2, 6: 1, 7: 2, 8: 2, 9: 3, 10: 3, 11: 2, 12: 2, 13: 3, 14: 2, 15: 3, 16: 2, 17: 4, 18: 2, 19: 2, 20: 1, 21: 2, 22: 1, 23: 2, 24: 1, 25: 2, 26: 2, 27: 4, 28: \'I will totally depends on you as the prof is not paying much attention to this couse and the TAs are also no that good in explaning .\', 29: \"The prof came hardly in 2 labs only.He even didn\'t explain anything.A lot of improvement is needed in this couse.\"}','2020-01-06 12:54:17.864066',104),(2874,'{0: 2, 1: 1, 2: 3, 3: 4, 4: 2, 5: 2, 6: 2, 7: 2, 8: 3, 9: 2, 10: 3, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 3, 18: 3, 19: 3, 20: 2, 21: 3, 22: 1, 23: 3, 24: 1, 25: 2, 26: 2, 27: 4, 28: \'Dont get a non serious partner or a seat too far from TAs.\', 29: \'Taught good soldering\'}','2020-01-06 12:54:17.868820',104),(2875,'{0: 2, 1: 1, 2: 2, 3: 3, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 