s enthusiasm and understanding of the course\'}','2020-01-06 12:54:17.992170',88),(2897,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 2, 6: 1, 7: 1, 8: 2, 9: 2, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 1, 20: 2, 21: 2, 22: 2, 23: 2, 24: 1, 25: 1, 26: 2, 27: 2, 28: \'More evaluations and project based learning rather than concept based learning \', 29: \'Punctual and approachable.\'}','2020-01-06 12:54:17.997531',88),(2898,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 1, 19: 1, 20: 2, 21: 2, 22: 2, 23: 1, 24: 3, 25: 2, 26: 2, 27: 2, 28: \'Take it iff you are interested\\r\\n\', 29: \'Chill Prof. \'}','2020-01-06 12:54:18.002476',90),(2899,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 1, 5: 2, 6: 1, 7: 1, 8: 2, 9: 3, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 2, 18: 3, 19: 3, 20: 2, 21: 2, 22: 1, 23: 2, 24: 3, 25: 1, 26: 2, 27: 2, 28: \"It\'s a course requiring effort. Don\'t take it unless you are willing to put in effort. \", 29: \'-\'}','2020-01-06 12:54:18.010060',90),(2900,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 3, 19: 2, 20: 3, 21: 2, 22: 2, 23: 3, 24: 2, 25: 1, 26: 2, 27: 3, 28: \'Dont take it\', 29: \'Deep Learning classes were not well taught. There was no explanation provided for the marking scheme of the search engine assignment, and different TAs had different leniency levels.\'}','2020-01-06 12:54:18.015013',88),(2901,'{0: 3, 1: 1, 2: 3, 3: 4, 4: 2, 5: 2, 6: 2, 7: 2, 8: 2, 9: 3, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 3, 18: 3, 19: 3, 20: 1, 21: 2, 22: 1, 23: 2, 24: 2, 25: 1, 26: 2, 27: 4, 28: \"Don\'t take it, way too much work\", 29: \'Explain concepts better instead of trying to cover multiple concepts. Especially make more of an effort in the DL portion.\'}','2020-01-06 12:54:18.020396',88),(2902,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 1, 5: 1, 6: 1, 7: 2, 8: 2, 9: 3, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 3, 19: 2, 20: 1, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 3, 28: \'just do it!\', 29: \"it would be better if instructor doesn\'t send students to teach.\"}','2020-01-06 12:54:18.024312',90),(2903,'{0: 2, 1: 2, 2: 2, 3: 1, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 3, 19: 2, 20: 2, 21: 3, 22: 1, 23: 1, 24: 3, 25: 1, 26: 1, 27: 1, 28: \'Be prepared for tough assignments and do them properly, as they are really helpful to understand the course\', 29: \'A bit louder voice is appreciated\'}','2020-01-06 12:54:18.028509',90),(2904,'{0: 2, 1: 2, 2: 3, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 3, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 1, 24: 3, 25: 1, 26: 2, 27: 2, 28: \"It\'s a good course if you\'re interested in research in robotics but a bit of self-study is necessary. Assignments are well made and very useful for those into research, but are time consuming.\", 29: \'Spend more time on teaching during the course, sticking to the objectives of the lecture rather than going off track which ends up wasting time. \'}','2020-01-06 12:54:18.032747',90),(2905,'{0: 3, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 3, 19: 2, 20: 2, 21: 2, 22: 2, 23: 1, 24: 3, 25: 1, 26: 2, 27: 2, 28: \"Don\'t take if it has this group of TAs. Professor excellent but TAs not good. Too much things covered due to which can\'t even focus on one thing and learn it. 4th year student have other stuff such as other courses and mainly research thus taking course as if it is the only thing student have in life is ridiculus. And Prof should only take class and not TAs. There is a reason why they are TAs and not Prof. \", 29: \'Teaches from basics which helps students who are not from RRC. Understands how to teach. \'}','2020-01-06 12:54:18.036647',90),(2906,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 1, 10: 2, 11: 1, 12: 2, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 1, 20: 2, 21: 2, 22: 2, 23: 1, 24: 2, 25: 1, 26: 2, 27: 1, 28: \'Get the basics covered of mathematics. Try to discuss questions outside the classrooms as well with your friends. Read from various resources to get the concept.\', 29: \'Well aware of the field. He can get more into rigorous maths and can restrict use of philosophical analogies. \\r\\nCourse assignment is real good and TA is helpful.\'}','2020-01-06 12:54:18.041366',90),(2907,'{0: 2, 1: 2, 2: 3, 3: 2, 4: 2, 5: 1, 6: 2, 7: 2, 8: 2, 9: 3, 10: 2, 11: 1, 12: 1, 13: 3, 14: 1, 15: 1, 16: 1, 17: 3, 18: 3, 19: 2, 20: 1, 21: 3, 22: 2, 23: 1, 24: 3, 25: 1, 26: 2, 27: 3, 28: \"Classroom wasn\'t so effective. Everything is learnt only by self-reading and implementing the assignments. The frequency of assignments is high. It is a bit hectic, but learning is guaranteed at the end of the assignments.\", 29: \'It would be helpful if explanation in classroom is as good as expectation during assignments.\'}','2020-01-06 12:54:18.045679',90),(2908,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 1, 5: 1, 6: 1, 7: 2, 8: 2, 9: 2, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'It requires effort.\', 29: \'Good slides, good assignments, TAs were good with concepts and motion planning lecture was good.\'}','2020-01-06 12:54:18.050039',90),(2909,'{0: 2, 1: 1, 2: 3, 3: 3, 4: 2, 5: 2, 6: 2, 7: 2, 8: 2, 9: 2, 10: 2, 11: 2, 12: 2, 13: 2, 14: 2, 15: 2, 16: 1, 17: 4, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 2, 24: 1, 25: 1, 26: 2, 27: 4, 28: \'.\', 29: \'.\'}','2020-01-06 12:54:18.054033',104),(2910,'{0: 2, 1: 2, 2: 1, 3: 1, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 1, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 1, 28: \'Start the assignment on the day1 of posting it.\', 29: \'The derivations and explanation using the black board helped me a lot in seeing the concepts evolve. His narration of past experiences with the concept being taught, helped me in understanding how to think from practical viewpoint.\'}','2020-01-06 12:54:18.057998',90),(2911,'{0: 1, 1: 1, 2: 3, 3: 5, 4: 2, 5: 2, 6: 2, 7: 2, 8: 3, 9: 3, 10: 3, 11: 2, 12: 2, 13: 3, 14: 2, 15: 2, 16: 2, 17: 5, 18: 2, 19: 2, 20: 1, 21: 3, 22: 3, 23: 2, 24: 2, 25: 1, 26: 1, 27: 5, 28: \'Mostly self learning.\', 29: \'Spend less time on useless stuff and scraping surface of everything and focus on selected important topic with math. If you are giving this much weightage to project and forcefully making teams, see that individual contribution is calculated separately. Evaluations of assignment and project are unfair and mostly depend on which TA you get assigned. This makes unfair disadvantage for some people.\'}','2020-01-06 12:54:18.061825',88),(2912,'{0: 3, 1: 2, 2: 2, 3: 3, 4: 2, 5: 2, 6: 2, 7: 2, 8: 2, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 3, 23: 2, 24: 2, 25: 1, 26: 2, 27: 3, 28: \'Course will overwhelm with lots of topic but you will not be able to segregate the concepts to build a project and the major project has nothing to do with the course.\', 29: \'There was a big confusion that was it a IRE class or NLP class, everything was in bits and pieces and till now I am confused how can I connect all the dots to create an interesting project with the knowledge.\'}','2020-01-06 12:54:18.066934',88),(2913,'{0: 2, 1: 2, 2: 2, 3: 4, 4: 2, 5: 1, 6: 1, 7: 2, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 3, 24: 2, 25: 1, 26: 1, 27: 3, 28: \'It is good for someone who wants to learn the fundamentals of text processing including retrieval. If one is looking for deep search engine or ir it is not the right course.\', 29: \"Constructive suggestions please:\\r\\n1. The course did not give a higher picture, lots of concepts have been discussed but they were never connected to the higher level course which is ire. \\r\\n2. It would have been good if, the course tries to cover less topics but end to end. For e.g. deeplearning based searching in the state of the art has not been covered. Only basic of deeplearning has been taught. Many many such gaps, NLP has been taught but how do we use in search engines not been.\\r\\n3. The projects are completely in NLP domain. I wish it more towards text retrieval. \\r\\n4. The differentiation of courses such as NLP NLA needs to be clear. It should not cover the same thing\\r\\n5. The motivation from the instructor for the course has always been towards grades. I\'m not sure it that is the right way, however it would have been better if the motivation was to stimulate passion towards the subject rather than grades. \\r\\n6. The assignments and evaluation could have been much better. There was no feedback given, the purpose of assignment is to make mistakes and learn, it would have been better if clear evaluation n feedback is provided which helps improve students. \\r\\n\"}','2020-01-06 12:54:18.072262',88),(2914,'{0: 3, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 2, 7: 1, 8: 2, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 3, 18: 3, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1, 26: 2, 27: 3, 28: \'Requires a lot of stuff related to ML. So take this course inly if you are familiar with it.\', 29: \'NA\'}','2020-01-06 12:54:18.077205',88),(2915,'{0: 3, 1: 2, 2: 1, 3: 2, 4: 1, 5: 2, 6: 1, 7: 2, 8: 1, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 1, 19: 3, 20: 2, 21: 2, 22: 1, 23: 1, 24: 2, 25: 1, 26: 2, 27: 2, 28: \"It\'s a very involved course, will require a lot of self learning too. Take it only if you don\'t many other equally heavy courses. Would not recommend on a heavy semester\", 29: \'ML and DL was taken in a very rushed way. Please slow down for complete novices too\'}','2020-01-06 12:54:18.081846',88),(