bject.\\r\\n\\r\\nSuggestions: Instead of reading slides, give an overview.\\r\\nEnsure that TAs explain how to get started with the assignment properly in tutorials.\\r\\n\\r\\nPlz don\'t reschedule classes on your whims and fancies. I understand that you had to attend a conference. But taking 3 classes 3 days before exam and expecting us to prepare it is impractical\"}','2020-01-06 12:54:18.425248',77),(2968,'{0: 3, 1: 3, 2: 2, 3: 2, 4: 1, 5: 2, 6: 2, 7: 2, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 2, 16: 2, 17: 2, 18: 2, 19: 3, 20: 2, 21: 2, 22: 1, 23: 2, 24: 3, 25: 2, 26: 1, 27: 3, 28: \'A good math elective, only if you are a math lover. This course is mostly about proofs and proofs and proofs.\', 29: \"I think the course grading was highly dependent on end sems and mids, aa there was no assignments.\\r\\nI think 2-3 assignments can be given so that students don\'t feel too much pressure at the exam time.\"}','2020-01-06 12:54:18.429355',126),(2969,'{0: 3, 1: 3, 2: 2, 3: 4, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 1, 19: 1, 20: 1, 21: 3, 22: 2, 23: 2, 24: 3, 25: 2, 26: 1, 27: 3, 28: \'Nothing\', 29: \'Nothing\'}','2020-01-06 12:54:18.433334',129),(2970,'{0: 2, 1: 2, 2: 1, 3: 3, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 3, 14: 1, 15: 2, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 1, 27: 2, 28: \"It\'s Interesting\", 29: \'Way of teaching\'}','2020-01-06 12:54:18.437615',129),(2971,'{0: 2, 1: 2, 2: 2, 3: 4, 4: 3, 5: 2, 6: 1, 7: 2, 8: 2, 9: 3, 10: 2, 11: 1, 12: 2, 13: 3, 14: 2, 15: 2, 16: 2, 17: 3, 18: 2, 19: 1, 20: 2, 21: 3, 22: 1, 23: 2, 24: 3, 25: 1, 26: 1, 27: 3, 28: \'-\', 29: \'-\'}','2020-01-06 12:54:18.441553',129),(2972,'{0: 2, 1: 2, 2: 3, 3: 3, 4: 3, 5: 2, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 2, 13: 3, 14: 2, 15: 3, 16: 2, 17: 3, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 3, 28: \'Practice everyday\', 29: \'The ins