 22: 2, 23: 2, 24: 3, 25: 1, 26: 2, 27: 5, 28: \'Check who is teaching and whether you can fit into this style of teaching. \', 29: \'We were never taught by Nita ma\\\'am, only suba ma\\\'am came to class, so please take all this feedback in that context.\\r\\n\\r\\nTeaching was exclusively through slides with lots of content being read in the class, \"why\" was rarely addressed\\r\\n\\r\\nThere was no attempt to make the class interesting or fun, coverage of course material seemed the key priority.\'}','2020-01-06 12:54:19.169043',138),(3086,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 2, 11: 1, 12: 2, 13: 2, 14: 2, 15: 1, 16: 3, 17: 3, 18: 3, 19: 3, 20: 2, 21: 2, 22: 2, 23: 3, 24: 3, 25: 1, 26: 2, 27: 3, 28: \'Take this course only if you were interested in the philosophy component of the course IHS. A disposition for philosophy is required, along with strong literary prowess, because ultimately the only thing that reaches the professor is your words.\', 29: \'Professor does not know how to operate moodle, which hurts assignment notification. There should be a session regarding what is required in a term paper.\'}','2020-01-06 12:54:19.173419',116),(3087,'{0: 3, 1: 3, 2: 3, 3: 3, 4: 2, 5: 2, 6: 2, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 2, 15: 2, 16: 2, 17: 3, 18: 2, 19: 3, 20: 1, 21: 2, 22: 2, 23: 2, 24: 3, 25: 1, 26: 2, 27: 3, 28: \"Start of course is good.\\r\\nBut then it\'s just formulas after formules- no intuition nor nothing.\\r\\nBetter learn from online resources.\", 29: \"Course started really well.\\r\\nBut then as it processed, number of topics increased hugely compared to time devoted to them.\\r\\nFelt like literature class, where slides were passed one after other and in between 1 or 2 examples were taken. This wasn\'t the maths class.\\r\\n\\r\\nPlease reduce number of topics so that sufficient time can be spent on understanding rather than rote learning of formulas.\\r\\n\\r\\nWhat\'s the point of learning formulas for so many methods, when there is not understanding developed to even differentiate b/w them and use them properly.\\r\\n\\r\\nAlso exams had too many questions. Felt like there is a question from each and every topic- which is a good thing actually but only when there is sufficient time provided.\\r\\n\"}','2020-01-06 12:54:19.178219',138),(3088,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'Study hard\', 29: \'Ability to communicate ideas\'}','2020-01-06 12:54:19.182365',129),(3089,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 1, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 1, 27: 2, 28: \'Good\', 29: \'Good\'}','2020-01-06 12:54:19.186439',129),(3090,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 1, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'increase classes\', 29: \'Good\'}','2020-01-06 12:54:19.190985',129),(3091,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 1, 20: 2, 21: 2, 22: 2, 23: 1, 24: 3, 25: 1, 26: 1, 27: 2, 28: \'Practice well\', 29: \'Covers each and every important point\'}','2020-01-06 12:54:19.213696',129),(3092,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 2, 6: 2, 7: 2, 8: 2, 9: 1, 10: 1, 11: 1, 12: 1, 13: 2, 14: 2, 15: 1, 16: 2, 17: 3, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 1, 27: 2, 28: \'Study after every class so that you can keep up\', 29: \'None\'}','2020-01-06 12:54:19.218519',129),(3093,'{0: 2, 1: 3, 2: 2, 3: 3, 4: 2, 5: 2, 6: 1, 7: 1, 8: 2, 9: 1, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 3, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 3, 25: 2, 26: 2, 27: 3, 28: \'Listen carefully, and learn everything taug