uld be spent on explaining the algebra sections of some parts.\'}','2020-01-06 12:54:19.762774',133),(3193,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 2, 7: 2, 8: 2, 9: 2, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'None\', 29: \'None\'}','2020-01-06 12:54:19.767611',133),(3194,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 2, 8: 2, 9: 2, 10: 2, 11: 1, 12: 2, 13: 1, 14: 2, 15: 1, 16: 2, 17: 3, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 3, 25: 1, 26: 2, 27: 3, 28: \' \', 29: \' \'}','2020-01-06 12:54:19.771966',133),(3195,'{0: 2, 1: 2, 2: 1, 3: 4, 4: 2, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 3, 22: 1, 23: 3, 24: 3, 25: 1, 26: 2, 27: 2, 28: \"science is a very abstract term. I was expecting biology, luckily that\'s what we\'re starting today (hopefully). but interestingly enough, though we never came across these things like Lagrange in real life. Hopefully something a little more applicable in real life, that\'s why I found it abstract. \", 29: \'Always approachable.\\r\\nVery confident\'}','2020-01-06 12:54:19.776952',133),(3196,'{0: 2, 1: 2, 2: 2, 3: 4, 4: 2, 5: 1, 6: 1, 7: 1, 8: 3, 9: 1, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 2, 18: 1, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 3, 25: 1, 26: 2, 27: 3, 28: \'Learning is not very much. Mostly JEE things except for a few new things. \', 29: \'Effective: Spent time in topics\\r\\n\\r\\nSuggestion: plz be a bit more strict :)\'}','2020-01-06 12:54:19.789576',133),(3197,'{0: 1, 1: 1, 2: 3, 3: 5, 4: 3, 5: 2, 6: 2, 7: 2, 8: 3, 9: 3, 10: 3, 11: 2, 12: 2, 13: 3, 14: 3, 15: 3, 16: 3, 17: 5, 18: 3, 19: 3, 20: 3, 21: 3, 22: 3, 23: 3, 24: 3, 25: 2, 26: 2, 27: 5, 28: \"Don\'t know anything.\", 29: \'Poor\'}','2020-01-06 12:54:19.794377',133),(3198,'{0: 2, 1: 2, 2: 1, 3: 1, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 1, 28: \'It is a good course to increase your Cgpa as you listen to his class very carefully \', 29: \'No suggestions, I feel everything is fine. \'}','2020-01-06 12:54:19.798763',133),(3199,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 2, 16: 2, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 1, 24: 2, 25: 1, 26: 2, 27: 3, 28: \'Tuuuuy\', 29: \'Ewrt\'}','2020-01-06 12:54:19.803022',133),(3200,'{0: 2, 1: 2, 2: 3, 3: 1, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 1, 10: 1, 11: 2, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 3, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1, 26: 2, 27: 2, 28: \'Take good notes in class\', 29: \'Sir maintained very good flow. But algebra was not very clear. \'}','2020-01-06 12:54:19.807093',133),(3201,'{0: 3, 1: 2, 2: 3, 3: 5, 4: 3, 5: 2, 6: 1, 7: 2, 8: 3, 9: 3, 10: 3, 11: 1, 12: 2, 13: 3, 14: 2, 15: 3, 16: 1, 17: 4, 18: 2, 19: 1, 20: 1, 21: 2, 22: 2, 23: 2, 24: 3, 25: 1, 26: 2, 27: 5, 28: \'As interesting as I thought the course would be, I was disappointed. The syllabus was fine and could have been made quite interesting by a good professor. Exams are heavily dependent on the derivations done in class, so there will be a need to memorize a lot.\\r\\nThe professor, although seemingly interested in teaching the course, focused more on the math part than the conceptual part. This was quite off-putting. \\r\\nAlthough seemingly difficult (not the content, but paying attention), the easiest way to perform well in this course is listening to lectures and making notes regularly.\', 29: \'Pros:\\r\\n1. Interested in teaching.\\r\\n2. Fair explanations.\\r\\n3. Examinations are better off theory based than problems as the focus in lectures is theory.\\r\\nCons:\\r\\n1. Too much focus on derivations: Perhaps the instructor should explain concepts in a more interesting way, and develop more focus on problem solving.\\r\\n2. Poor marking in examinations: There are \\\'hidden\\\' markings in papers. For example, \"Enlist 3 reasons why...\" should not mean \"Explain 3 reasons why...\" for a 2 mark question. Questions should be clear and precise. \\r\\n3. Poor teaching attitude:\\r\\n    a. The instructor expects all students to listen and understand the class when each class is heavily dependent on the previous classes and little to no recap is provided. Not everyone is attentive all the time, so perhaps pause, and recap what happened periodically. Does not allow pee breaks.\\r\\n    b. Monotonous: It is like listening to a flat tone for 90 minutes, no variations in pitch when explaining which creates ambiguities in learning (for example, some parts of an explanation require some sort of emphasis).\'}','2020-01-06 12:54:19.811104',133),(3202,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 1, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 3, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 1, 24: 3, 25: 1, 26: 2, 27: 3, 28: \'Nothing\', 29: \'The explanation was quite constructive but the classes turn out to be a bit boring \'}','2020-01-06 12:54:19.816435',133),(3203,'{0: 1, 1: 2, 2: 1, 3: 3, 4: 2, 5: 2, 6: 1, 7: 2, 8: 2, 9: 3, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 3, 19: 2, 20: 2, 21: 3, 22: 2, 23: 2, 24: 3, 25: 2, 26: 2, 27: 3, 28: \'-\', 29: \'-\'}','2020-01-06 12:54:19.820176',74),(3204,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 2, 5: 1, 6: 1, 7: 2, 8: 1, 9: 3, 10: 1, 11: 1, 12: 2, 13: 1, 14: 1, 15: 1, 16: 2, 17: 2, 18: 3, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 3, 25: 2, 26: 2, 27: 2, 28: \'Good course to learn about computational sciences and relevant softwares.\', 29: \"Please make sure that classes are conducted, and please keep multiple TAs for this course. Since the whole course needs quite a lot of self learning, I don\'t think one TA would be able to handle the doubts of all 27 people\"}','2020-01-06 12:54:19.824083',74),(3205,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 1, 5: 2, 6: 2, 7