: 2, 20: 2, 21: 2, 22: 1, 23: 2, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'Be thorough with the notes and practice regularly. \', 29: \'There is no issue with the way things are going. \'}','2020-01-06 12:54:20.048792',132),(3248,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 1, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 3, 19: 1, 20: 2, 21: 3, 22: 1, 23: 1, 24: 2, 25: 1, 26: 2, 27: 1, 28: \'Please Take the course to get very well understanding about the probability and random processes.\', 29: \'1) Nice explanation.\\r\\n2) Doing enough problems.\\r\\n3) Good understanding.\'}','2020-01-06 12:54:20.052547',132),(3249,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1, 26: 1, 27: 1, 28: \'No\', 29: \'No\'}','2020-01-06 12:54:20.056760',114),(3250,'{0: 2, 1: 2, 2: 2, 3: 5, 4: 3, 5: 1, 6: 2, 7: 1, 8: 2, 9: 2, 10: 2, 11: 1, 12: 2, 13: 2, 14: 3, 15: 1, 16: 2, 17: 3, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 2, 25: 1, 26: 1, 27: 3, 28: \'Follow the book along with the course.\', 29: \"I think the professor tries too hard to carry all the students. Tutorial sessions help those who are interested. They should not be mandatory, it\'s just a waste of time for other students. Also, the pace of the course was really slow, probably to help weaker students, but it was very discouraging for someone like me who easily gets bored.\"}','2020-01-06 12:54:20.061703',132),(3251,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 3, 14: 1, 15: 1, 16: 2, 17: 3, 18: 2, 19: 2, 20: 2, 21: 3, 22: 1, 23: 1, 24: 2, 25: 1, 26: 2, 27: 2, 28: \'Be prepared to work with tricky questions\', 29: \'Reading assignments beforehand would be helpful\'}','2020-01-06 12:54:20.065597',131),(3252,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 23: 2, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'Practice.\', 29: \'NA\'}','2020-01-06 12:54:20.069573',131),(3253,'{1: 2, 4: 2, 8: 2, 9: 1, 10: 2, 11: 1, 12: 1, 14: 1, 17: 2, 19: 2, 20: 2, 26: 2, 27: 2, 28: \'good course but do not allow prof to conduct quizzes instead of assignment\', 29: \'should come to class with more preparation\'}','2020-01-06 12:54:20.073443',131),(3254,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 1, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 1, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'Reading the textbook in parallel with the class is really beneficial.\', 29: \'Unsolved problems and the problems in tests were really good and helped clarify concepts.\\r\\n\\r\\nAlso really good tutorials were held by the TAs, especially Ayush.\'}','2020-01-06 12:54:20.077249',131),(3255,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 3, 20: 2, 21: 3, 22: 2, 23: 1, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'-\', 29: \'Adjusting to the pace of the class is important.\'}','2020-01-06 12:54:20.081797',131),(3256,'{0: 3, 1: 2, 2: 3, 3: 1, 4: 3, 5: 2, 6: 2, 7: 2, 8: 3, 9: 2, 10: 1, 11: 2, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 3, 18: 2, 19: 1, 20: 2, 21: 3, 22: 2, 23: 2, 24: 2, 25: 1, 26: 1, 27: 4, 28: \"It\'s a self learning course by the resources posted by prof than what we learn in class ?????\", 29: \'He should give the questions which he will be able to solve during the same time given to students to solve and giving correct answers as he already prepares before presenting.....\\r\\n\'}','2020-01-06 12:54:20.086246',131),(3257,'{1: 3, 4: 2, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 14: 1, 17: 2, 19: 2, 20: 2, 26: 2, 28: \'Sir will post problem sets. Solve them.\', 29: \'The random processes topic has less time dedicated to it, thus making you rush through it.\'}','2020-01-06 12:54:20.090591',132),(3258,'{0: 2, 1: 2, 2: 2, 3: 1, 4: 2, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1, 26: 1, 27: 1, 28: \'.\', 29: \'.\'}','2020-01-06 12:54:20.095127',105),(3259,'{0: 2, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 3, 18: 2, 19: 1, 20: 2, 21: 2, 22: 2, 23: 2, 24: 1, 25: 1, 26: 2, 27: 3, 28: \'Do all the projects yourself.\', 29: \'Fun way of learning\'}','2020-01-06 12:54:20.099637',105),(3260,'{0: 2, 1: 3, 2: 2, 3: 2, 4: 1, 5: 1, 6: 2, 7: 2, 8: 2, 9: 2, 10: 2, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 3, 19: 2, 20: 2, 21: 3, 22: 3, 23: 2, 24: 3, 25: 1, 26: 1, 27: 2, 28: \'Read the textbook a little before doing the course since a lot of topics are covered but a not enough time is there to practice so practice is needed. Keep practicing and keep ahead of class\', 29: \'I liked that there were ample resources given to understand each topic .\\r\\nThis was also the most organized course I have taken in IIIT yet . \\r\\nThe grading was TA dependent and some people got their marks increased or more marks because of the kind of TA that corrected their paper .marking was almost binary. \\r\\n However , the class tests that were taken were hard and sometimes we needed to do 10 - 15 problems for preparation instead of the promised 4 questions \'}','2020-01-06 12:54:20.116077',131),(3261,'{0: 2, 1: 1, 2: 2, 3: 3, 4: 2, 5: 1, 6: 2, 7: 1, 8: 2, 9: 2, 10: 2, 11: 2, 12: 1, 13: 2, 14: 2, 15: 2, 16: 2, 17: 4, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 2, 25: 1, 26: 1, 27: 4, 28: \'Best of luck\', 29: \'Get more guest lecturera\'}','2020-01-06 12:54:20.133098',105),(3262,'{0: 1, 1: 1, 2: 3, 3: 4, 4: 2, 5: 2, 6: 2, 7: 2, 8: 3, 9: 3, 10: 3, 11: 1, 12: 2, 13: 3, 14: 2, 15: 2, 16: 3, 17: 5, 18: 3, 19: 3, 20: 1, 21: 3, 22: 3, 23: 3, 24: 2, 25: 1, 26: 2, 27: 5, 28: \'Not an Elective\', 29: \'As this is the backbone of ECE,time given to understand and teach verilog should be increased.Also,backend design must be done properly in class,exam markings should be proper and fair and teaching should be enough so that we can do final project without having to learn a ton by ourself.Grading for project should be proper as Viva should be on the design instead of trivial things\'}','2020-01-06 12:54:20.143321',105),(3263,'{0: 1, 1: 1, 2: 3, 3: 5, 4: 3, 6: 2, 7: 2, 8: 3, 9: 3, 10: 3, 11: 2, 12: 2, 13: 3, 14: 2, 15: 3, 16: 3, 17: 5, 18: 3, 19: 1, 20: 1, 21: 3, 22: 2, 23: 3, 24: 2, 25: 1, 26: 1, 27: 5, 28: \"Don\'t take it\", 29: \'I have some points to say about VLSI \\r\\n\\r\\n1. This was not a properly planned course \\r\\n2. This is not the subject which the professor is strong at. \\r\\n3. A course which was completely taught in the labs had no official lab as such, this is a cruel joke.\\r\\n4. The assignments were laborious, every week it\\\'s a hectic job to do but there was nothing new we had learnt. \\r\\n5. Neither Prof nor the TAs had a complete idea of what the assignments were and what a student would gain from it.\\r\\n6. Any doubt we ask sir, he is clueless about it and I can even recall a conversation where I asked him about a circuit, he said \"I FORGOT AND I HAVE TO LEARN ALONG WITH YOU\"( This was a doubt regarding a question in the assignment, and he expects us to do these assignments by ourselves )\\r\\n7. The guest lectures were conducted by industry experts, which was more of general knowledge stuff, like  processor design, chip manufacturing, etc. Which is not VLSI as such. If, in the exams, questions are going to come from these lectures, I wonder why not we rename this course to \"General Knowledge but not VLSI\".\\r\\n8. Any question , we ask the Prof regarding the projects and the what he is expecting us to present, the reply we get is \"You guys ask me everything in detail, if I explain this question to you, you will again come up with a new one, so I won\\\'t tell you this.\" So you don\\\'t tell us what you want, ask me to figure out what you are thinking in your mind and present it to you, I am no psychologist to be able to figure that out. I didn\\\'t know that psychology was a necessary skill in order to take this course. I am sorry, I apologise.\\r\\n\\r\\nSuggestions :\\r\\nThe only problem is that the professor assumes that we already know everything and we came to the class just to get our previous knowledge tested. If sir realised that we are students and no t scholars, I don\\\'t find any problem with doing this course.\'}','2020-01-06 12:54:20.152438',105),(3264,'{0: 1, 1: 1, 2: 2, 3: 5, 4: 3, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 3, 11: 1, 12: 2, 13: 2, 14: 2, 15: 2, 16: 1, 17: 5, 18: 2, 19: 3, 20: 1, 21: 3, 22: 1, 23: 3, 24: 1, 25: 1, 26: 2, 27: 5, 28: \'Do not depend on the prof. Learn DSM well because half of the course is the same\', 29: \"Only 8 classes were taken in the entire sem(excluding guest lectures) .so I don\'t see the point of having a professor for this course. There was a lot of self learning involved.\"}','2020-01-06 12:54:20.157778',105),(3265,'{0: 1, 1: 1, 2: 2, 3: 4, 4: 3, 5: 2, 6: 2, 7: 2, 8: 2, 9: 3, 10: 3, 11: 2, 12: 2, 13: 2, 14: 1, 15: 1, 16: 2, 17: 4, 18: 2, 19: 2, 20: 1, 21: 3, 22: 1, 23: 2, 24: 2, 25: 1, 26: 2, 27: 4, 28: \'None\', 29: \'There was no clear structure prepared before the course began due to which there was proper coordination on topics covered. Assignments which required learning xilinx and cadence were given, but we the basics which were used to learn these languages were not given.We had seen a video uploaded by the TAs,and did whatever they did without understanding why actually we were doing it.\'}','2020-01-06 12:54:20.166288',105),(3266,'{0: 1, 1: 1, 2: 3, 3: 4, 4: 3, 5: 1, 6: 2, 7: 2, 8: 2, 9: 3, 10: 3, 11: 2, 12: 2, 13: 2, 14: 2, 15: 2, 16: 2, 17: 4, 18: 2, 19: 2, 20: 1, 21: 2, 22: 2, 23: 3, 24: 2, 25: 1, 26: 2, 27: 4, 28: \'This course does not provide the insight into the VLSI design aspects which you would expect from this course. The course meant to be based on front end and back end design aspects does not explain any of the them with any clarity.\', 29: \'The course instructor lacked in knowledge of the course and could not explain any of the design aspects clearly in the course\\r\\n\'}','2020-01-06 12:54:20.175356',105),(3267,'{0: 3, 1: 1, 2: 2, 3: 4, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 3, 10: 2, 11: 2, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 4, 18: 2, 19: 1, 20: 1, 21: 3, 22: 2, 23: 2, 24: 2, 25: 1, 26: 2, 27: 3, 28: \'This is not an elective course\', 29: \'Please try out the feasibility of assignments before giving them out. (Make sure they are doable) The questions in exam were too lengthy. Please consider that the students have to think about the question and also need to write enough content to satisfy the marks. \'}','2020-01-06 12:54:20.180723',105),(3268,'{0: 1, 1: 1, 2: 2, 3: 1, 4: 1, 5: 1, 6: 2, 7: 2, 8: 2, 9: 3, 10: 3, 11: 1, 12: 1, 13: 2, 14: 1, 15: 2, 16: 2, 17: 4, 18: 2, 19: 1, 20: 2, 21: 2, 22: 2, 23: 1, 24: 1, 25: 1, 26: 2, 27: 3, 28: \'Requires a lot of self learning and classes are a bit boring. \', 29: \'This is a very badly structured course\\r\\nThere is hardly any relation between what is done in class and what is there for labs.\\r\\n\'}','2020-01-06 12:54:20.186167',105),(3269,'{0: 1, 1: 1, 2: 3, 3: 5, 4: 3, 5: 1, 6: 2, 7: 2, 8: 2, 9: 3, 10: 2, 11: 1, 12: 2, 13: 2, 14: 1, 15: 2, 16: 1, 17: 3, 18: 3, 19: 1, 20: 2, 21: 3, 22: 2, 23: 2, 24: 1, 25: 1, 26: 2, 27: 4, 28: \'This is a course with very interesting topics, that starts off really well but quickly deteriorates with time, as labs are held(which arent officially even part of the course) in which you would be asked to use lot of tools and softwares that you have never heard of before without any instruction as to how they work. The lab assignments are also very hectic and time consuming, and is mostly labour work which involves no new learning. It is essentially just writing code in Verilog for 10-25 mins and then spending 2-3 hours generating reports on a server and taking screenshots. So my advice will be to not worry about how tedious this course can be, and focus on the other courses.\', 29: \'The instructor teaches the topics that he does actually cover really well. Classes taught by the instructor(happened essentially only till the first quiz) were interesting and captivating. The only problem is that a majority of the course(which happened in labs) was not taken up as topics to be covered in the class leaving us clueless about these topics. Hence I feel that if all the topics are covered in class(including those done in labs, especially the tools we used), then the course would be much more enjoyable.\'}','2020-01-06 12:54:20.191100',105),(3270,'{0: 2, 1: 2, 2: 1, 3: 3, 4: 1, 5: 2, 6: 2, 7: 1, 8: 2, 9: 3, 10: 2, 11: 1, 12: 2, 13: 2, 14: 1, 15: 1, 16: 3, 17: 3, 18: 3, 19: 3, 20: 2, 21: 3, 22: 3, 23: 3, 24: 2, 25: 2, 26: 2, 27: 3, 28: \'Best of Luck\', 29: \' \'}','2020-01-06 12:54:20.203168',106),(3271,'{0: 2, 1: 2, 2: 2, 4: 1, 5: 2, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 1, 20: 2, 21: 2, 22: 1, 23: 2, 24: 3, 25: 1, 26: 2, 27: 1, 28: \'If interested one of the best\', 29: \'Become less strict and give less assignments\'}','2020-01-06 12:54:20.208410',106),(3272,'{0: 2, 1: 2, 2: 3, 3: 3, 4: 3, 5: 2, 6: 1, 7: 2, 8: 2, 9: 3, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 2, 17: 2, 18: 3, 19: 3, 20: 2, 21: 2, 22: 2, 23: 3, 24: 2, 25: 2, 26: 1, 27: 3, 28: \'Required course for the Electronics branch\', 29: \'Too many assignments\'}','2020-01-06 12:54:20.212674',106),(3273,'{0: 3, 1: 3, 2: 3, 3: 5, 4: 3, 5: 2, 6: 2, 7: 2, 8: 3, 9: 3, 10: 2, 11: 1, 12: 2, 13: 3, 14: 1, 15: 2, 16: 2, 17: 4, 18: 3, 19: 3, 20: 1, 21: 3, 22: 3, 23: 3, 24: 2, 25: 2, 26: 2, 27: 5, 28: \'No\', 29: \'No\'}','2020-01-06 12:54:20.217269',106),(3274,'{0: 1, 1: 1, 2: 2, 3: 4, 4: 2, 6: 2, 8: 1, 9: 2, 10: 2, 11: 1, 12: 2, 13: 3, 14