 2, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'If you want to learn pure and basic machine learning topics then this is the best course.\', 29: \'Explain each and every point.\'}','2020-01-06 12:54:20.929462',87),(3387,'{0: 3, 1: 3, 2: 1, 3: 1, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 3, 19: 1, 20: 3, 21: 3, 22: 1, 26: 2, 28: \'This is a heavy course. We get homework after each class consisting 3 questions ( sometimes very tricky). Assignments are also tough. But overall the course is good and interesting.\', 29: \'Instructor is good and very interactive. Though there is no prerequisite for this course, he expects you to have basic knowledge.\'}','2020-01-06 12:54:20.934650',87),(3388,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 14: 2, 15: 1, 16: 2, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 3, 25: 1, 26: 2, 27: 1, 28: \'A very interesting course. A lot of things to learn. A lot of HWs to do as well!! \', 29: \'This instructor always motivates the students to read more about a particular concept. Great teaching. Enjoyed the course\'}','2020-01-06 12:54:20.938698',87),(3389,'{0: 3, 1: 3, 2: 1, 3: 1, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 3, 19: 1, 20: 2, 21: 2, 22: 2, 23: 1, 24: 1, 25: 1, 26: 1, 27: 1, 28: \'This course is a heavy course, choose the other courses lightly.\', 29: \'The homework questions were not straight forward and helped in better understanding of the concepts\'}','2020-01-06 12:54:20.943193',87),(3390,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 1, 27: 1, 28: \'Good introduction to discrete maths\', 29: \'none \'}','2020-01-06 12:54:20.947487',127),(3391,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 1, 5: 2, 6: 2, 7: 2, 8: 1, 9: 3, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 3, 22: 2, 23: 2, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'Course is quite hard, do reading as thoroughly as possible\', 29: \'Please find a better way to get the material through to our heads than exams and assignments as exams evaluate us in a fixed time and we are penalised for small mistakes even when on the right track of thinking and assignments do not teach us too much\'}','2020-01-06 12:54:20.951533',127),(3392,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 1, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 3, 20: 2, 21: 2, 22: 2, 23: 2, 24: 1, 25: 2, 26: 2, 27: 2, 28: \'Nil\', 29: \'Great presentation\'}','2020-01-06 12:54:20.955427',86),(3393,'{0: 2, 1: 2, 2: 1, 3: 1, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 1, 28: \'Read course books\', 29: \'Great at explaining\'}','2020-01-06 12:54:20.959707',134),(3394,'{0: 2, 1: 2, 2: 2, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 1, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 1, 28: \'Read up on the materials in timely fashion.\', 29: \'Include more math in the course.\'}','2020-01-06 12:54:20.963805',134),(3395,'{0: 2, 1: 3, 2: 1, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 1, 28: \'An interesting course which provides the chance to learn many new things.\', 29: \'Hardworking and always makes sure students understand everything.\'}','2020-01-06 12:54:20.967835',127),(3396,'{0: 3, 1: 2, 2: 2, 3: 3, 4: 2, 5: 2, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'The course is very good if you have high interest level but can get tough even if you miss out on a little of the course content as everything is connected and requires a strong mathematical background \', 29: \'He utilized class time well and posted resources on time. However, his explanation in class is not easy for everyone to follow as he proceeds through the course content very quickly. It would be great if he could slow down a bit and just makes sure that everyone understands what is actually going on. \'}','2020-01-06 12:54:20.971745',134),(3397,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 1, 27: 1, 28: \'Great as a first Quantum course.\', 29: \'Should have predecessor Mathematical methods for Physicists and other Quantum courses well placed after it.Great\'}','2020-01-06 12:54:20.975690',134),(3398,'{0: 2, 1: 2, 2: 1, 3: 1, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 1, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 1, 28: \'Totally worth taking the course. It gives you an insight to Quantum Mechanics in a beautiful way\', 29: \'His way of treating people is the best. He gives students respect. His command on the subject is immense but never makes is feel like an idiot fir asking stupid questions. Easily the best professor i have had in my 3 semesters\\r\\n\'}','2020-01-06 12:54:20.980341',134),(3399,'{0: 3, 1: 2, 2: 2, 3: 3, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 1, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'The course aims to cover a lot of topics. Thus every topic cannot be properly explained in the class and requires a lot of self reading. \', 29: \'None\'}','2020-01-06 12:54:20.984942',134),(3400,'{0: 2, 1: 2, 2: 1, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 3, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 1, 28: \'Once you opt for the subject be prepared to work hard, sometimes the subject is so dry.\', 29: \'i opted this course without any background knowledge but the instructor made the subject look very interesting and explained things clearly\'}','2020-01-06 12:54:20.989496',134),(3401,'{0: 3, 1: 2, 2: 2, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 2, 28: \'Try to learn the material somewhat in advance. Subject by itself is quite tricky which requires a lot of thought. Only classroom study is not sufficient like it is in other courses.\', 29: \"The instructor is extremely jolly and enthusiastic about the subject which somewhat helped me through the course even though I am not interested in QM. \\r\\nI like it very much that he stresses on the need to understand the material for the joy of it and not for exams.\\r\\nThough, for those like me who are not inherently interested in QM it would have helped us if there were tutorial from the beginning itself in which we solve the problems at the back of chapters in the class with some guidance.\\r\\nSometimes forced problem solving leads to an interest in the subject.\\r\\n\\r\\nAnother feedback is that : allowing cheat sheets for all exams takes away the incentive to pay attention in all the classes since many students just write all that there is in small handwriting and get good marks. This results in to the fact that only those stay ahead in class who already had a lot of interest in the subject.\\r\\nSomeone like me who didn\'t know anything about QM started the sem with paying attention in all classes but since the material itself is very dense and I could get marks without having to study much in small exams like quizzes, eventually slacked of because there were other courses which were also demanding.\\r\\n\\r\\nOverall this course was taken very nicely and I really appreciate all the effort that the professor took to make this course smooth for everyone.\"}','2020-01-06 12:54:20.995630',134),(3402,'{1: 2, 4: 2, 8: 2, 9: 2, 10: 2, 11: 1, 12: 1, 14: 1, 17: 3, 18: 2, 19: 2, 20: 2, 26: 1, 28: \'Good\', 29: \'Weird marking scheme\'}','2020-01-06 12:54:21.021510',84),(3403,'{0: 3, 1: 3, 2: 2, 3: 3, 4: 2, 5: 1, 6: 2, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 3, 22: 1, 23: 1, 24: 3, 25: 1, 26: 2, 27: 3, 28: \'NA\', 29: \'NA\'}','2020-01-06 12:54:21.027096',84),(3404,'{0: 3, 1: 3, 2: 1, 3: 2, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 3, 22: 2, 23: 2, 24: 1, 25: 1, 26: 1, 27: 1, 28: \'Good course. \', 29: \'No comments\'}','2020-01-06 12:54:21.031164',89),(3405,'{0: 2, 1: 2, 2: 1, 3: 1, 4: 1, 5: 1, 6: 1, 7: 1, 8: 1, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 1, 18: 2, 19: 2, 20: 2, 21: 2, 22: 1, 23: 1, 24: 1, 25: 1, 26: 1, 27: 1, 28: \'Noting\', 29: \'Nothing\'}','2020-01-06 12:54:21.035368',89),(3406,'{0: 1, 1: 2, 2: 2, 3: 3, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 1, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 1, 24: 1, 25: 1, 26: 1, 27: 2, 28: \'Fundamentals of image processing\', 29: \'Most of the concepts are already covered in DSAA and DSP. Could be integrated into the Computer Vision course\'}','2020-01-06 12:54:21.039358',89),(3407,'{0: 3, 1: 3, 2: 1, 3: 2, 4: 2, 5: 1, 6: 1, 7: 1, 8: 2, 9: 2, 10: 1, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 1, 20: 2, 21: 2, 22: 1, 23: 2, 24: 1, 25: 1, 26: 1, 27: 2, 28: \' \', 29: \' \'}','2020-01-06 12:54:21.043690',89),(3408,'{0: 2, 1: 2, 2: 1, 3: 1, 4: 1, 5: 1, 6: 1, 7: 1, 8: 2, 9: 1, 10: 2, 11: 1, 12: 1, 13: 2, 14: 1, 15: 1, 16: 1, 17: 2, 18: 2, 19: 2, 20: 2, 21: 2, 22: 2, 23: 2, 24: 1, 25: 1, 26: 1, 27: 2, 28: \'no change\', 29: \'no change\'}','2020-01-06 12:54:21.048299',89),(3409,'{0: 2, 1: 2, 2: 2, 3: 3